            INSERT INTO api_varseldefinisjon (unik_id, kode, tittel, forklaring, handling, avviklet, opprettet) VALUES ('ab8d2192-9363-4705-b29b-c7ec5c44f173', 'RV_VV_13', '26 uker siden forrige utbetaling av sykepenger, vurder om vilkårene for sykepenger er oppfylt', 'Bruker har tidligere fått utbetalt sykepenger til maksdato. Det er nå mer enn 26 uker siden siste utbetaling av sykepenger(§ 8-12).', 'Saken må behandles som en førstegangssak og alle vilkårene for å få sykepenger må vurderes.', 'true', '1970-01-01 00:00:00.000000') ON CONFLICT(unik_id) DO NOTHING;
            INSERT INTO api_varseldefinisjon (unik_id, kode, tittel, forklaring, handling, avviklet, opprettet) VALUES ('b3186bb0-f311-4953-aab6-ad6820a0c7e2', 'RV_IM_9', 'ArbeidsforholdsID er fylt ut i inntektsmeldingen. Kontroller om brukeren har flere arbeidsforhold i samme virksomhet. Flere arbeidsforhold støttes ikke av systemet foreløpig.', null, null, 'true', '1970-01-01 00:00:00.000000') ON CONFLICT(unik_id) DO NOTHING;
            INSERT INTO api_varseldefinisjon (unik_id, kode, tittel, forklaring, handling, avviklet, opprettet) VALUES ('5aa8c0ae-e47e-4aae-88ce-884174c909fb', 'RV_IM_9', 'ArbeidsforholdsID er fylt ut i inntektsmeldingen. Kontroller om brukeren har flere arbeidsforhold i samme virksomhet. Systemet har foreløpig begrenset støtte for dette.', 'ArbeidsforholdsID fra inntektsmeldingen er utfylt:', 'Undersøk om inntekten som er oppgitt er lik det som er innrapportert de siste månedene i A-ordningen. Hvis innrapportert lønn avviker mye fra det arbeidsgiveren oppgir, så undersøk om det er flere stillinger hos samme arbeidsgiver i AA-registeret. Hvis det er flere arbeidsforhold og inntektsmeldingen kun gjelder for én av dem, må saken behandles i Infotrygd. I alle andre tilfeller kan saken behandles i Speil.', 'true', '1970-01-01 00:00:00.000000') ON CONFLICT(unik_id) DO NOTHING;
            INSERT INTO api_varseldefinisjon (unik_id, kode, tittel, forklaring, handling, avviklet, opprettet) VALUES ('51e0f55e-f620-4c64-b26b-7571c50706cb', 'RV_IM_9', 'ArbeidsforholdsID er fylt ut i inntektsmeldingen. Kontroller om brukeren har flere arbeidsforhold i samme virksomhet. Systemet har foreløpig begrenset støtte i forhold til dette.', null, null, 'true', '1970-01-01 00:00:00.000000') ON CONFLICT(unik_id) DO NOTHING;
            INSERT INTO api_varseldefinisjon (unik_id, kode, tittel, forklaring, handling, avviklet, opprettet) VALUES ('4f5ef091-0f27-476f-96d1-9d6dd26d8e74', 'RV_IM_9', 'ArbeidsforholdsID fra inntektsmeldingen er utfylt', null, null, 'true', '1970-01-01 00:00:00.000000') ON CONFLICT(unik_id) DO NOTHING;
            INSERT INTO api_varseldefinisjon (unik_id, kode, tittel, forklaring, handling, avviklet, opprettet) VALUES ('d482026d-ff2f-45db-93e8-0c3432163db2', 'RV_VV_1', 'Arbeidsgiver er ikke registrert i Aa-registeret.', 'Arbeidsgiver på sykmelding eller inntektsmelding er ikke registrert i Aa-registeret.', 'Sjekk at bruker er ansatt hos arbeidsgiveren.', 'false', '1970-01-01 00:00:00.000000') ON CONFLICT(unik_id) DO NOTHING;
