            INSERT INTO api_varseldefinisjon (unik_id, kode, tittel, forklaring, handling, avviklet, opprettet) VALUES ('5958a754-cf4e-4782-a1f5-874aea0a5a0d', 'RV_VV_5', 'Bruker mangler nødvendig inntekt ved validering av Vilkårsgrunnlag', null, null, 'false', '1970-01-01 00:00:00.000000') ON CONFLICT(unik_id) DO NOTHING;
            INSERT INTO api_varseldefinisjon (unik_id, kode, tittel, forklaring, handling, avviklet, opprettet) VALUES ('74cd05d1-638f-4fa1-8299-3acf54fe8ff8', 'RV_SV_4', 'Brukeren har flere inntekter de siste tre måneder enn det som er brukt i sykepengegrunnlaget. Kontroller om brukeren har andre arbeidsforhold eller ytelser på sykmeldingstidspunktet som påvirker utbetalingen.', 'A-ordningen har flere inntekter de siste tre måneder enn det som er brukt i sykepengegrunnlaget', 'Sjekk om den sykmeldte har flere aktive inntektskilder på sykmeldingstidspunktet enn arbeidsgivere vi har sykmelding for. Speil håndterer ikke kombinasjonen arbeidstaker og frilanser. I slike tilfeller må saken behandles i Infotrygd.', 'true', '1970-01-01 00:00:00.000000') ON CONFLICT(unik_id) DO NOTHING;
            INSERT INTO api_varseldefinisjon (unik_id, kode, tittel, forklaring, handling, avviklet, opprettet) VALUES ('5d32d8ba-be1e-4e70-aab3-d1324acb1673', 'RV_SV_4', 'Brukeren har flere inntekter de siste tre måneder. Kontroller om brukeren har flere arbeidsforhold eller andre ytelser på sykmeldingstidspunktet som påvirker utbetalingen.', 'Det finnes inntekter fra mer enn én arbeidsgiver i A-ordningen i de siste tre månedene', 'Sjekk om den sykmeldte har flere aktive inntektskilder på sykmeldingstidspunktet. Speil håndterer ikke kombinasjonen arbeidstaker og frilanser. I slike tilfeller må saken behandles i Infotrygd.', 'true', '1970-01-01 00:00:00.000000') ON CONFLICT(unik_id) DO NOTHING;
            INSERT INTO api_varseldefinisjon (unik_id, kode, tittel, forklaring, handling, avviklet, opprettet) VALUES ('75cf5347-fe38-423f-ba49-18447533ce3d', 'RV_IT_19', 'Dagsatsen har endret seg minst én gang i en historisk, sammenhengende periode i Infotrygd.', null, null, 'true', '1970-01-01 00:00:00.000000') ON CONFLICT(unik_id) DO NOTHING;
