            INSERT INTO api_varseldefinisjon (unik_id, kode, tittel, forklaring, handling, avviklet, opprettet) VALUES ('56277249-c4cc-451c-a207-0f42a084a1ce', 'RV_SØ_10', 'Den sykmeldte har oppgitt å ha andre arbeidsforhold med sykmelding i søknaden.', 'Ved mottak av søknaden kjente vi bare til sykdom hos én arbeidsgiver.', 'Hvis sykepengegrunnlaget er fastsatt feil, eller det er sykmelding for flere arbeidsforhold som ikke er lagt til grunn, må saken behandles i Infotrygd.', 'false', '1970-01-01 00:00:00.000000') ON CONFLICT(unik_id) DO NOTHING;
            INSERT INTO api_varseldefinisjon (unik_id, kode, tittel, forklaring, handling, avviklet, opprettet) VALUES ('76b0bd8a-a50e-46f5-943a-9063d74be4b7', 'RV_VV_8', 'Den sykmeldte har skiftet arbeidsgiver, og det er beregnet at den nye arbeidsgiveren mottar refusjon lik forrige. Kontroller at dagsatsen blir riktig.', 'Den sykmeldte har skiftet arbeidsgiver i løpet av sykefraværet.', 'Sjekk at riktig dagsats er lagt til grunn.', 'false', '1970-01-01 00:00:00.000000') ON CONFLICT(unik_id) DO NOTHING;
            INSERT INTO api_varseldefinisjon (unik_id, kode, tittel, forklaring, handling, avviklet, opprettet) VALUES ('565e5c60-6aed-4bd8-8c64-1fbe5a0f0870', 'RV_RV_1', 'Denne perioden var tidligere regnet som innenfor arbeidsgiverperioden', null, null, 'false', '1970-01-01 00:00:00.000000') ON CONFLICT(unik_id) DO NOTHING;
            INSERT INTO api_varseldefinisjon (unik_id, kode, tittel, forklaring, handling, avviklet, opprettet) VALUES ('93e19d6f-2dc8-415c-a477-369ecce8d202', 'RV_VV_14', 'Denne personen har en utbetaling for samme periode for en annen arbeidsgiver. Kontroller at beregningene for begge arbeidsgiverne er korrekte.', 'Da vi beregnet den forrige utbetalingen visste vi ikke at personen var syk for denne arbeidsgiveren.', 'Det kan hende at begge beregningene er riktig, men dette må kontrolleres. Hvis det er feil må perioder som er ferdig behandlet annulleres og alt må behandles i Infotrygd.', 'true', '1970-01-01 00:00:00.000000') ON CONFLICT(unik_id) DO NOTHING;
            INSERT INTO api_varseldefinisjon (unik_id, kode, tittel, forklaring, handling, avviklet, opprettet) VALUES ('952c7beb-70fc-4af2-a0c5-a0369d0382cb', 'RV_OO_1', 'Det er behandlet en søknad i Speil for en senere periode enn denne.', 'Søknadene har ikke kommet i vanlig rekkefølge. Dette kan skje dersom den sykmeldte avbryter en søknad/sykmelding, eller en lege skriver ut en tilbakedatert sykmelding. Perioder som allerede er avsluttet vil revurderes når denne perioden godkjennes.', 'Undersøk at behandlingen av perioden blir riktig.', 'false', '1970-01-01 00:00:00.000000') ON CONFLICT(unik_id) DO NOTHING;
            INSERT INTO api_varseldefinisjon (unik_id, kode, tittel, forklaring, handling, avviklet, opprettet) VALUES ('161dc651-0c79-480e-b554-9655eb5df280', 'RV_IT_7', 'Det er en ugyldig utbetalingsperiode i Infotrygd (fom er nyere enn tom)', 'Det er lest inn en utbetalingsperiode fra Infotrygd som er mangelfull. Det er fire ulike årsaker til at dette kan skje: Utbetalingsperioden mangler f.o.m. eller t.o.m. dato. F.o.m. er nyere enn t.o.m. Utbetalingsgrad mangler. Utbetalingsgrad er mindre eller lik 0', 'Undersøk om saken kan revurderes i Speil og at utbetalingen blir riktig. Hvis saken ikke kan revurderes i Speil, må du annullere og behandle saken i Infotrygd.', 'false', '1970-01-01 00:00:00.000000') ON CONFLICT(unik_id) DO NOTHING;
            INSERT INTO api_varseldefinisjon (unik_id, kode, tittel, forklaring, handling, avviklet, opprettet) VALUES ('14f42dbf-f547-40b5-9e6d-8167a9f5baf6', 'RV_IT_20', 'Det er en utbetalingsperiode som er lagt inn i Infotrygd uten at inntektsopplysninger er registrert.', null, null, 'true', '1970-01-01 00:00:00.000000') ON CONFLICT(unik_id) DO NOTHING;
            INSERT INTO api_varseldefinisjon (unik_id, kode, tittel, forklaring, handling, avviklet, opprettet) VALUES ('17dcd363-c8a0-48c0-8eb9-17082c790e36', 'RV_AY_9', 'Det er institusjonsopphold i perioden. Vurder retten til sykepenger.', 'Vi henter inn opplysninger om institusjonsopphold. Det har kommet informasjon om at den sykmeldte oppholdt seg i institusjon (sykehus eller fengsel) i perioden.', 'Undersøk om institusjonsoppholdet er forenlig med å motta sykepenger. Dersom en periode skal avslås på grunn av institusjonsopphold må saken annulleres og behandles i Infotrygd.', 'false', '1970-01-01 00:00:00.000000') ON CONFLICT(unik_id) DO NOTHING;
            INSERT INTO api_varseldefinisjon (unik_id, kode, tittel, forklaring, handling, avviklet, opprettet) VALUES ('4d236fca-76a6-4a88-9fae-4a7b324d4ea4', 'RV_IT_21', 'Det er lagt inn flere inntekter i Infotrygd med samme fom-dato, den seneste er lagt til grunn. Kontroller sykepengegrunnlaget.', null, null, 'true', '1970-01-01 00:00:00.000000') ON CONFLICT(unik_id) DO NOTHING;
            INSERT INTO api_varseldefinisjon (unik_id, kode, tittel, forklaring, handling, avviklet, opprettet) VALUES ('e5ddd6f6-7de0-415d-94a2-bde89658bae5', 'RV_IT_21', 'Det er lagt inn flere inntekter i Infotrygd med samme fom-dato. Kontroller sykepengegrunnlaget.', null, null, 'true', '1970-01-01 00:00:00.000000') ON CONFLICT(unik_id) DO NOTHING;
            INSERT INTO api_varseldefinisjon (unik_id, kode, tittel, forklaring, handling, avviklet, opprettet) VALUES ('111a8cbd-16c1-4dfd-aede-88e96e6d6e2d', 'RV_IT_22', 'Det er lagt inn statslønn i Infotrygd, undersøk at sykepengegrunnlaget er fastsatt riktig.', null, null, 'true', '1970-01-01 00:00:00.000000') ON CONFLICT(unik_id) DO NOTHING;
            INSERT INTO api_varseldefinisjon (unik_id, kode, tittel, forklaring, handling, avviklet, opprettet) VALUES ('41243280-847d-4101-ab5b-42d0c53c02ca', 'RV_IT_22', 'Det er lagt inn statslønn i Infotrygd, undersøk at utbetalingen blir riktig.', 'Det ligger statslønn på en SP VT-ident i Infotrygd', 'Kontrollér at bruker kun har ett arbeidsforhold/inntektskilde i det sykefraværet som skal dekkes i Speil', 'true', '1970-01-01 00:00:00.000000') ON CONFLICT(unik_id) DO NOTHING;
            INSERT INTO api_varseldefinisjon (unik_id, kode, tittel, forklaring, handling, avviklet, opprettet) VALUES ('39b1e9fd-836c-4299-af7d-df58321483d2', 'RV_SØ_9', 'Det er oppgitt annen inntektskilde i søknaden. Vurder inntekt.', 'Den sykmeldte har oppgitt «Annet» som annen inntektskilde i søknaden.', 'Sjekk hva den andre inntektskilden består av og vurder om saken kan behandles i Speil. Hvis saken ikke kan behandles i Speil, må du behandle saken i Infotrygd.', 'false', '1970-01-01 00:00:00.000000') ON CONFLICT(unik_id) DO NOTHING;
            INSERT INTO api_varseldefinisjon (unik_id, kode, tittel, forklaring, handling, avviklet, opprettet) VALUES ('367f9dda-44df-45b0-9f64-2af56b6241f6', 'RV_IT_11', 'Det er registrert bruk av på nødnummer', null, null, 'false', '1970-01-01 00:00:00.000000') ON CONFLICT(unik_id) DO NOTHING;
            INSERT INTO api_varseldefinisjon (unik_id, kode, tittel, forklaring, handling, avviklet, opprettet) VALUES ('ae322c27-4e2e-45c4-bb00-16a1ddf89843', 'RV_IT_4', 'Det er registrert utbetaling på nødnummer', 'Denne sakstypen tas normalt ikke inn i Speil. Det kan ha skjedd en endring fra saken ble behandlet første gang til den nå skal revurderes.', 'Undersøk om saken kan revurderes i Speil og at utbetalingen blir riktig. Hvis saken ikke kan revurderes i Speil, må du annullere og behandle saken i Infotrygd.', 'false', '1970-01-01 00:00:00.000000') ON CONFLICT(unik_id) DO NOTHING;
            INSERT INTO api_varseldefinisjon (unik_id, kode, tittel, forklaring, handling, avviklet, opprettet) VALUES ('7d542df3-dab9-4731-9717-0d5304d9ea3a', 'RV_SI_3', 'Det er simulert et negativt beløp.', 'Vedtaksløsningen foreslår å omgjøre tidligere utbetaling av sykepenger, slik at hele eller deler av simuleringen gir et negativt beløp.', 'Undersøk om simuleringen gir et ønsket og riktig resultat og korriger hvis simuleringen er feil. Hvis simuleringen er riktig, se rutine for revurdering, feilutbetaling og tilbakekreving.', 'false', '1970-01-01 00:00:00.000000') ON CONFLICT(unik_id) DO NOTHING;
            INSERT INTO api_varseldefinisjon (unik_id, kode, tittel, forklaring, handling, avviklet, opprettet) VALUES ('19e7d825-eb68-4ac7-bf26-d151d264f89e', 'RV_IT_1', 'Det er utbetalt en periode i Infotrygd etter perioden du skal behandle nå. Undersøk at antall forbrukte dager og grunnlag i Infotrygd er riktig', null, null, 'false', '1970-01-01 00:00:00.000000') ON CONFLICT(unik_id) DO NOTHING;
            INSERT INTO api_varseldefinisjon (unik_id, kode, tittel, forklaring, handling, avviklet, opprettet) VALUES ('42bf0da6-a8ea-4890-9e93-dcf79a810c7d', 'RV_IT_1', 'Det er utbetalt en periode i Infotrygd etter perioden du skal revurdere nå. Undersøk at antall forbrukte dager og grunnlag i Infotrygd er riktig', null, null, 'false', '1970-01-01 00:00:00.000000') ON CONFLICT(unik_id) DO NOTHING;
            INSERT INTO api_varseldefinisjon (unik_id, kode, tittel, forklaring, handling, avviklet, opprettet) VALUES ('3b4d7ca9-aefe-41a9-8aa9-b4721d15e016', 'RV_AY_5', 'Det er utbetalt foreldrepenger i samme periode.', 'Det er utbetalt foreldrepenger i Infotrygd etter at perioden ble godkjent i Speil.', 'Undersøk hvilken ytelse som er riktig. Hvis utbetalingene i Speil må avslås på grunn av andre ytelser må du annullere og behandle i Infotrygd.', 'false', '1970-01-01 00:00:00.000000') ON CONFLICT(unik_id) DO NOTHING;
            INSERT INTO api_varseldefinisjon (unik_id, kode, tittel, forklaring, handling, avviklet, opprettet) VALUES ('b162faf7-9f02-401b-91bf-307dfce14fbb', 'RV_AY_7', 'Det er utbetalt omsorgspenger i samme periode.', 'Det er utbetalt omsorgspenger i Infotrygd etter at perioden ble godkjent i Speil.', 'Undersøk hvilken ytelse som er riktig. Hvis utbetalingene i Speil må avslås på grunn av andre ytelser må du annullere og behandle i Infotrygd.', 'false', '1970-01-01 00:00:00.000000') ON CONFLICT(unik_id) DO NOTHING;
            INSERT INTO api_varseldefinisjon (unik_id, kode, tittel, forklaring, handling, avviklet, opprettet) VALUES ('11fbd4de-7130-41a0-8536-71c94129568f', 'RV_AY_6', 'Det er utbetalt pleiepenger i samme periode.', 'Det er utbetalt pleiepenger i Infotrygd etter at perioden ble godkjent i Speil.', 'Undersøk hvilken ytelse som er riktig. Hvis utbetalingene i Speil må avslås på grunn av andre ytelser må du annullere og behandle i Infotrygd.', 'false', '1970-01-01 00:00:00.000000') ON CONFLICT(unik_id) DO NOTHING;
            INSERT INTO api_varseldefinisjon (unik_id, kode, tittel, forklaring, handling, avviklet, opprettet) VALUES ('8c2f4822-834d-4817-bfd1-9b668a3e914d', 'SB_EX_1', 'Det finnes åpne oppgaver på sykepenger i Gosys', 'Det ligger aktive oppgaver med tema sykepenger i Gosys.', 'Sjekk Gosys-oppgavene og vurder om de påvirker saksbehandlingen.', 'false', '1970-01-01 00:00:00.000000') ON CONFLICT(unik_id) DO NOTHING;
            INSERT INTO api_varseldefinisjon (unik_id, kode, tittel, forklaring, handling, avviklet, opprettet) VALUES ('9ae2ee76-7147-49c2-a05a-519a0d5ed893', 'RV_IT_23', 'Direkte overgang fra Infotrygd. Dagsatsen har endret seg minst én gang i Infotrygd. Kontroller at sykepengegrunnlaget er riktig.', null, null, 'true', '1970-01-01 00:00:00.000000') ON CONFLICT(unik_id) DO NOTHING;
            INSERT INTO api_varseldefinisjon (unik_id, kode, tittel, forklaring, handling, avviklet, opprettet) VALUES ('83d46a83-5be5-44e6-bf62-e8d59465ae61', 'RV_OS_3', 'Endrer tidligere oppdrag. Kontroller simuleringen.', 'Det er opphørt en tidligere linje i Oppdrag. Dette skjer dersom en FOM-dato på en linje endrer seg.', 'Undersøk om perioden blir riktig simulert, og ta en sjekk på oppdraget i ettertid', 'false', '1970-01-01 00:00:00.000000') ON CONFLICT(unik_id) DO NOTHING;
            INSERT INTO api_varseldefinisjon (unik_id, kode, tittel, forklaring, handling, avviklet, opprettet) VALUES ('1d76ee13-ed0d-4f65-82e5-4e8e5c14654c', 'RV_IV_3', 'Fant frilanserinntekt på en arbeidsgiver de siste 3 månedene', null, null, 'false', '1970-01-01 00:00:00.000000') ON CONFLICT(unik_id) DO NOTHING;
            INSERT INTO api_varseldefinisjon (unik_id, kode, tittel, forklaring, handling, avviklet, opprettet) VALUES ('77c46a41-08cb-41f6-8c57-46628ea86d01', 'RV_IM_17', 'Inntektsmelding inneholder ikke arbeidsgiverperiode. Vurder om  arbeidsgiverperioden beregnes riktig', null, null, 'true', '1970-01-01 00:00:00.000000') ON CONFLICT(unik_id) DO NOTHING;
            INSERT INTO api_varseldefinisjon (unik_id, kode, tittel, forklaring, handling, avviklet, opprettet) VALUES ('60b64860-5402-4560-99e0-9ef8b5e493d6', 'RV_RE_1', 'Fant ikke refusjonsgrad for perioden. Undersøk oppgitt refusjon før du utbetaler.', 'Fant ikke informasjon om det er refusjon i perioden. Refusjonen er satt til 100 % siden det samsvarer med siste utbetalte periode i Infotrygd.', 'Undersøk hva som er oppgitt i siste inntektsmelding og eventuell informasjon i Infotrygd. Dersom refusjonen er satt feil må perioden behandles i Infotrygd.', 'false', '1970-01-01 00:00:00.000000') ON CONFLICT(unik_id) DO NOTHING;
            INSERT INTO api_varseldefinisjon (unik_id, kode, tittel, forklaring, handling, avviklet, opprettet) VALUES ('f02b7ad2-d0a8-459f-bbb6-6a4db01ab814', 'RV_SI_1', 'Feil under simulering', null, null, 'false', '1970-01-01 00:00:00.000000') ON CONFLICT(unik_id) DO NOTHING;
            INSERT INTO api_varseldefinisjon (unik_id, kode, tittel, forklaring, handling, avviklet, opprettet) VALUES ('6b564284-d6f3-4063-954c-d18d5b3050c7', 'RV_IV_4', 'Finnes inntekter fra flere virksomheter siste tre måneder', null, null, 'true', '1970-01-01 00:00:00.000000') ON CONFLICT(unik_id) DO NOTHING;
            INSERT INTO api_varseldefinisjon (unik_id, kode, tittel, forklaring, handling, avviklet, opprettet) VALUES ('cf954734-a840-404f-9755-08ccc6d844e5', 'RV_VV_2', 'Flere arbeidsgivere og ulikt starttidspunkt for sykefraværet', null, null, 'false', '1970-01-01 00:00:00.000000') ON CONFLICT(unik_id) DO NOTHING;
            INSERT INTO api_varseldefinisjon (unik_id, kode, tittel, forklaring, handling, avviklet, opprettet) VALUES ('1f695040-927e-424f-9cfc-ce0de05b5d61', 'RV_VV_2', 'Flere arbeidsgivere, ulikt starttidspunkt for sykefraværet eller ikke fravær fra alle arbeidsforhold', 'Det tidligste sykefraværet bestemmer skjæringstidspunktet. Dette gjelder: Inntekt på inntektsmeldingen som kommer fra arbeidsgivere med senere starttidspunkt kan gjelde feil periode og/eller inntekten som er foreslått for minst et av arbeidsforholdene er innhentet fra a-ordningen og er gjennomsnittet av rapportert inntekt de tre siste månedene før tidspunktet for arbeidsuførhet (§8-28 3. ledd bokstav a).', 'Du må fastsette et sykepengegrunnlag basert på inntekt fra alle arbeidsforholdene. Du må vurdere om de foreslåtte arbeidsforholdene er reelle og skal tas med i beregningen.  Hvis det er kommet inntektsmelding fra arbeidsgiver med senere starttidspunkt, må det sjekkes om inntekten for dette arbeidsforholdet er riktig beregnet (§8-28). Hvis det ikke er kommet inntektsmelding fra denne arbeidsgiveren, må den foreslåtte inntekten vurderes. Du må vurdere om den innhentede inntekten er riktig. Sjekk om det er et nytt arbeidsforhold eller varig lønnsendring i beregningsperioden. Sjekk om det variasjoner i inntekten som kan bety at det er lovlig fravær uten lønn i beregningsperioden. Vurderes etter §8-28.', 'false', '1970-01-01 00:00:00.000000') ON CONFLICT(unik_id) DO NOTHING;
            INSERT INTO api_varseldefinisjon (unik_id, kode, tittel, forklaring, handling, avviklet, opprettet) VALUES ('b26bc06d-b9e3-4b39-8d92-8af31c73ed89', 'RV_IT_24', 'Forkaster perioden fordi vi har oppdaget utbetalinger i Infotrygd', null, null, 'true', '1970-01-01 00:00:00.000000') ON CONFLICT(unik_id) DO NOTHING;
            INSERT INTO api_varseldefinisjon (unik_id, kode, tittel, forklaring, handling, avviklet, opprettet) VALUES ('29f9c78e-ff5e-4f32-a44c-cb3ee34d11ce', 'RV_IT_14', 'Forlenger en Infotrygdperiode på tvers av arbeidsgivere', null, null, 'false', '1970-01-01 00:00:00.000000') ON CONFLICT(unik_id) DO NOTHING;
            INSERT INTO api_varseldefinisjon (unik_id, kode, tittel, forklaring, handling, avviklet, opprettet) VALUES ('311763f9-ca0d-4482-9996-1d08b1d551a2', 'RV_IM_10', 'Første fraværsdag i inntektsmeldingen er forskjellig fra foregående tilstøtende periode', null, null, 'true', '1970-01-01 00:00:00.000000') ON CONFLICT(unik_id) DO NOTHING;
            INSERT INTO api_varseldefinisjon (unik_id, kode, tittel, forklaring, handling, avviklet, opprettet) VALUES ('33423fcf-7997-423e-9775-e822f3b845ec', 'RV_IM_11', 'Første fraværsdag i inntektsmeldingen er ulik første fraværsdag i sykdomsperioden', null, null, 'true', '1970-01-01 00:00:00.000000') ON CONFLICT(unik_id) DO NOTHING;
            INSERT INTO api_varseldefinisjon (unik_id, kode, tittel, forklaring, handling, avviklet, opprettet) VALUES ('65dfecec-ecba-431b-94a3-1476fea5a14f', 'RV_IM_2', 'Første fraværsdag i inntektsmeldingen er ulik skjæringstidspunktet. Kontrollér at inntektsmeldingen er knyttet til riktig periode.', 'Første fraværsdag i inntektsmeldingen er ulik første fraværsdag i sykdomsperioden:', 'Kontroller at skjæringstidspunktet er riktig.', 'false', '1970-01-01 00:00:00.000000') ON CONFLICT(unik_id) DO NOTHING;
            INSERT INTO api_varseldefinisjon (unik_id, kode, tittel, forklaring, handling, avviklet, opprettet) VALUES ('c5e61266-75fc-4d9c-ad5e-8919c77f0889', 'RV_IM_12', 'Første fraværsdag i inntektsmeldingen er utenfor søknadsperioden. Kontroller at inntektsmeldingen er knyttet til riktig periode', null, null, 'true', '1970-01-01 00:00:00.000000') ON CONFLICT(unik_id) DO NOTHING;
            INSERT INTO api_varseldefinisjon (unik_id, kode, tittel, forklaring, handling, avviklet, opprettet) VALUES ('4dad5250-a0f1-4e3c-9035-003fc98605b8', 'RV_IM_13', 'Første fraværsdag i inntektsmeldingen er utenfor sykmeldingsperioden', null, null, 'true', '1970-01-01 00:00:00.000000') ON CONFLICT(unik_id) DO NOTHING;
            INSERT INTO api_varseldefinisjon (unik_id, kode, tittel, forklaring, handling, avviklet, opprettet) VALUES ('2bf29baf-a4b4-4b67-a008-fb7c4541b5e4', 'RV_IM_14', 'Første fraværsdag oppgitt i inntektsmeldingen er ulik den systemet har beregnet. Utbetal kun hvis dagsatsen er korrekt', 'Det er forskjell mellom det arbeidsgiver har oppgitt som første fraværsdag og sykmeldingens fra og med-dato.', 'Sjekk om dagsatsen er riktig, og om saken faktisk er under 25 prosent avvik med sammenligningsgrunnlaget.', 'true', '1970-01-01 00:00:00.000000') ON CONFLICT(unik_id) DO NOTHING;
            INSERT INTO api_varseldefinisjon (unik_id, kode, tittel, forklaring, handling, avviklet, opprettet) VALUES ('ba0cf4e6-abdb-4deb-89eb-088f097f9292', 'RV_IM_15', 'Første fraværsdag oppgitt i inntektsmeldingen er ulik den systemet har beregnet. Vurder hvilken inntektsmelding som skal legges til grunn, og utbetal kun hvis dagsatsen er korrekt i forhold til denne.', null, null, 'true', '1970-01-01 00:00:00.000000') ON CONFLICT(unik_id) DO NOTHING;
            INSERT INTO api_varseldefinisjon (unik_id, kode, tittel, forklaring, handling, avviklet, opprettet) VALUES ('d3939e73-79f8-4b7c-bc95-77998fc7501d', 'RV_VV_3', 'Første utbetalingsdag er i Infotrygd og mellom 1. og 16. mai. Kontroller at riktig grunnbeløp er brukt.', 'Vi klarer ikke å lese riktig skjæringstidspunkt når saken har startet i Infotrygd. Vi må kontrollere at riktig grunnbeløp er brukt i saker med sykepengegrunnlag over 6G.', 'Kontroller at dagsatsen samsvarer med grunnbeløpet som skal brukes.', 'true', '1970-01-01 00:00:00.000000') ON CONFLICT(unik_id) DO NOTHING;
            INSERT INTO api_varseldefinisjon (unik_id, kode, tittel, forklaring, handling, avviklet, opprettet) VALUES ('1fc44ffa-5df4-4c5e-a8b9-629fa469714a', 'RV_UT_12', 'Forventet ikke simulering på utbetaling=2a5e02b7-6a88-4434-8598-6fd49a05e0f4 i tilstand=Forkastet', null, null, 'false', '1970-01-01 00:00:00.000000') ON CONFLICT(unik_id) DO NOTHING;
            INSERT INTO api_varseldefinisjon (unik_id, kode, tittel, forklaring, handling, avviklet, opprettet) VALUES ('4e0dc0df-dfe9-47f0-a49d-1ed0add34dd1', 'RV_UT_12', 'Forventet ikke simulering på utbetaling=ae6bf452-8c46-458f-84d8-ca9f755ef152 i tilstand=Forkastet', null, null, 'false', '1970-01-01 00:00:00.000000') ON CONFLICT(unik_id) DO NOTHING;
