            INSERT INTO api_varseldefinisjon (unik_id, kode, tittel, forklaring, handling, avviklet, opprettet) VALUES ('c80ac5f3-19fc-4f61-87d4-5aa7ed53c8f7', 'RV_IV_2', 'Har mer enn 25 % avvik', null, null, 'false', '1970-01-01 00:00:00.000000') ON CONFLICT(unik_id) DO NOTHING;
            INSERT INTO api_varseldefinisjon (unik_id, kode, tittel, forklaring, handling, avviklet, opprettet) VALUES ('2c3e3106-7a6c-47bc-a149-eb32fcbfd7ff', 'RV_IV_2', 'Har mer enn 25 % avvik. Dette støttes foreløpig ikke i Speil. Du må derfor annullere periodene.', 'Det er lagt inn en ny inntekt som gir 25 % avvik. Skjønnsmessig fastsettelse av sykepengegrunnlaget støttes ikke i Speil.', 'Du kan endre inntekten en gang til hvis du har gjort noe feil. Dersom endringen skal gjennomføres må periodene annulleres i Speil og behandles i Infotrygd.', 'false', '1970-01-01 00:00:00.000000') ON CONFLICT(unik_id) DO NOTHING;
            INSERT INTO api_varseldefinisjon (unik_id, kode, tittel, forklaring, handling, avviklet, opprettet) VALUES ('d2375467-5562-4352-a54f-608bd772d62e', 'RV_AY_6', 'Har overlappende pleiepengeytelse med syketilfelle', null, null, 'false', '1970-01-01 00:00:00.000000') ON CONFLICT(unik_id) DO NOTHING;
            INSERT INTO api_varseldefinisjon (unik_id, kode, tittel, forklaring, handling, avviklet, opprettet) VALUES ('b65c62b8-7b80-4c02-b9d9-a871a9142432', 'RV_IT_25', 'Har utbetalt periode i Infotrygd nærmere enn 18 dager fra første dag', null, null, 'true', '1970-01-01 00:00:00.000000') ON CONFLICT(unik_id) DO NOTHING;
            INSERT INTO api_varseldefinisjon (unik_id, kode, tittel, forklaring, handling, avviklet, opprettet) VALUES ('811fc159-44f0-4287-87ee-c5e1ca7a469a', 'SB_EX_2', 'Ikke registrert eller mangler samtykke i Kontakt- og reservasjonsregisteret, eventuell kommunikasjon må skje i brevform', 'Brukeren ikke har bekreftet valget om reservasjon de siste 18 månedene.', 'Dersom vi ønsker å kommunisere med brukeren, enten for å sende et vedtak eller hente inn informasjon, må det være på brev og ikke i automatiske løsninger.', 'false', '1970-01-01 00:00:00.000000') ON CONFLICT(unik_id) DO NOTHING;
            INSERT INTO api_varseldefinisjon (unik_id, kode, tittel, forklaring, handling, avviklet, opprettet) VALUES ('3b8c7478-2073-4074-9d29-34ef2ba671f6', 'RV_IT_26', 'Infotrygd inneholder utbetalinger med varierende dagsats for en sammenhengende periode', null, null, 'true', '1970-01-01 00:00:00.000000') ON CONFLICT(unik_id) DO NOTHING;
            INSERT INTO api_varseldefinisjon (unik_id, kode, tittel, forklaring, handling, avviklet, opprettet) VALUES ('76880e91-8ccd-4db6-b69a-0df6e1baa98c', 'RV_SI_4', 'Ingenting ble simulert', 'Det er oppgitt ferieavvikling i hele søknadsperioden', 'Sjekk om ferieavvikling er oppgitt i søknaden', 'true', '1970-01-01 00:00:00.000000') ON CONFLICT(unik_id) DO NOTHING;
