            INSERT INTO api_varseldefinisjon (unik_id, kode, tittel, forklaring, handling, avviklet, opprettet) VALUES ('8042bd6b-abc1-4554-99ab-ed106ff8faf1', 'RV_IV_6', 'Inntekter fra mer enn én arbeidsgiver i A-ordningen siste tre måneder. Kontroller om brukeren har flere arbeidsforhold på sykmeldingstidspunktet. Flere arbeidsforhold støttes ikke av systemet.', null, null, 'true', '1970-01-01 00:00:00.000000') ON CONFLICT(unik_id) DO NOTHING;
            INSERT INTO api_varseldefinisjon (unik_id, kode, tittel, forklaring, handling, avviklet, opprettet) VALUES ('15800cf5-a329-43bf-a88d-c98a61b337b8', 'RV_IM_16', 'Inntektsmelding inneholder ikke arbeidsgiverperiode', null, null, 'true', '1970-01-01 00:00:00.000000') ON CONFLICT(unik_id) DO NOTHING;
            INSERT INTO api_varseldefinisjon (unik_id, kode, tittel, forklaring, handling, avviklet, opprettet) VALUES ('526a4405-6fe5-4cb3-aced-c557a9f6493e', 'RV_IM_16', 'Inntektsmelding inneholder ikke arbeidsgiverperiode. Kontroller at det kun er én arbeidsgiver. Flere arbeidsforhold støttes ikke av systemet', null, null, 'true', '1970-01-01 00:00:00.000000') ON CONFLICT(unik_id) DO NOTHING;
            INSERT INTO api_varseldefinisjon (unik_id, kode, tittel, forklaring, handling, avviklet, opprettet) VALUES ('ecf11ebc-1193-4367-9d5f-451b99de3227', 'SB_RV_1', 'Faresignaler oppdaget. Kontroller om faresignalene påvirker retten til sykepenger.', null, null, 'false', '1970-01-01 00:00:00.000000') ON CONFLICT(unik_id) DO NOTHING;
            INSERT INTO api_varseldefinisjon (unik_id, kode, tittel, forklaring, handling, avviklet, opprettet) VALUES ('9fb980ed-eb92-4a06-ba9e-4caedd9c85eb', 'RV_IM_18', 'Inntektsmeldingen mangler arbeidsgiverperiode. Vurder om vilkårene for sykepenger er oppfylt, og om det skal være arbeidsgiverperiode', 'Selvforklarende. Oppstår dersom inntektsmelding kommer inn for et arbeidsforhold bruker ikke er sykmeldt i.', 'Kontrollér at det kun er én arbeidsgiver. Skal kun komme ved flere arbeidsforhold i samme virksomhet.', 'true', '1970-01-01 00:00:00.000000') ON CONFLICT(unik_id) DO NOTHING;
            INSERT INTO api_varseldefinisjon (unik_id, kode, tittel, forklaring, handling, avviklet, opprettet) VALUES ('8aeccdfe-5d4c-4f71-9aaf-6d2d3104728d', 'RV_IM_3', 'Inntektsmeldingen og vedtaksløsningen er uenige om beregningen av arbeidsgiverperioden. Undersøk hva som er riktig arbeidsgiverperiode.', 'Arbeidsgiver og vedtaksløsningen har beregnet arbeidsgiverperioden ulikt.', 'Vurder hva som er riktig arbeidsgiverperiode. Hvis forslaget til vedtaksløsningen er feil, må saken behandles i Infotrygd.', 'false', '1970-01-01 00:00:00.000000') ON CONFLICT(unik_id) DO NOTHING;
            INSERT INTO api_varseldefinisjon (unik_id, kode, tittel, forklaring, handling, avviklet, opprettet) VALUES ('1a20655c-7618-41a5-a092-92f0edf603f2', 'RV_SØ_23', 'Korrigert søknad er mottatt med nye opplysninger - kontroller dagene i sykmeldingsperioden', 'Det har kommet en korrigert søknad som er lagt til grunn', 'Kontroller at dagene i sykmeldingsperioden blir riktig', 'true', '1970-01-01 00:00:00.000000') ON CONFLICT(unik_id) DO NOTHING;
