            INSERT INTO api_varseldefinisjon (unik_id, kode, tittel, forklaring, handling, avviklet, opprettet) VALUES ('5502040f-4593-49ab-b32c-528a64f7f474', 'RV_VV_15', 'Maks antall sykepengedager er nådd i perioden. Vurder å sende vedtaksbrev fra Infotrygd', 'Maks antall sykepengedager er nådd i perioden', 'Du trenger ikke å sende avslag når bruker har sammenhengende sykmelding fra maksdatoen. Søknaden behandles og «utbetales» i ny løsning selv om det ikke fører til noen utbetaling.', 'true', '1970-01-01 00:00:00.000000') ON CONFLICT(unik_id) DO NOTHING;
            INSERT INTO api_varseldefinisjon (unik_id, kode, tittel, forklaring, handling, avviklet, opprettet) VALUES ('ec8d5ecc-475f-4cf9-a02a-c5bf0bcf4ce2', 'RV_IT_5', 'Mangler inntekt for første utbetalingsdag i en av infotrygdperiodene', 'Denne sakstypen tas normalt ikke inn i Speil. Det kan ha skjedd en endring fra saken ble behandlet første gang til den nå skal revurderes.', 'Undersøk om saken kan revurderes i Speil og at utbetalingen blir riktig. Hvis saken ikke kan revurderes i Speil, må du annullere og behandle saken i Infotrygd.', 'true', '1970-01-01 00:00:00.000000') ON CONFLICT(unik_id) DO NOTHING;
