            INSERT INTO api_varseldefinisjon (unik_id, kode, tittel, forklaring, handling, avviklet, opprettet) VALUES ('3c4a5edf-36c1-44e7-9364-70978e198ba8', 'RV_SØ_2', 'Minst én dag er avslått på grunn av foreldelse. Vurder å sende vedtaksbrev fra Infotrygd', 'Søknaden har kommet inn mer enn 3 måneder før dagen/dagene.', 'Hvis det ikke finnes noe unntak fra foreldelsesfristen skal du godkjenne i Speil og sende vedtaksbrev fra Infotrygd. Hvis forslaget er feil må du avvise saken i Speil og behandle i Infotrygd. Dersom dagen/dagene som er avslått er innenfor arbeidsgiverperioden trenger du ikke å sende avslag fra Infotrygd.', 'false', '1970-01-01 00:00:00.000000') ON CONFLICT(unik_id) DO NOTHING;
