            INSERT INTO api_varseldefinisjon (unik_id, kode, tittel, forklaring, handling, avviklet, opprettet) VALUES ('b9447a48-d41a-4b6c-aad6-7dcd06edfe2f', 'RV_IT_27', 'Opplysninger fra Infotrygd har endret seg etter at vedtaket ble fattet. Undersøk om det er overlapp med periode fra Infotrygd.', 'Vi fikk informasjon fra Infotrygd som er annerledes enn da vedtaket ble fattet.', 'Hvis en periode overlapper med Infotrygd så må utbetalingen i Infotrygd returføres. Undersøk også om opplysningene fra Infotrygd er endret, f.eks. i vedtaksinformasjonen. Om den nye informasjonen i Infotrygd er korrekt og fører til at saken ikke støttes i Speil, må den annulleres.', 'true', '1970-01-01 00:00:00.000000') ON CONFLICT(unik_id) DO NOTHING;
            INSERT INTO api_varseldefinisjon (unik_id, kode, tittel, forklaring, handling, avviklet, opprettet) VALUES ('4388a668-ea94-4647-b16b-d8bce7947667', 'RV_OV_2', 'Opptjeningsvurdering må gjøres manuelt fordi opplysningene fra AA-registeret er ufullstendige', null, null, 'true', '1970-01-01 00:00:00.000000') ON CONFLICT(unik_id) DO NOTHING;
            INSERT INTO api_varseldefinisjon (unik_id, kode, tittel, forklaring, handling, avviklet, opprettet) VALUES ('9ec2d574-1b14-494d-9c21-9d1f756b3cb4', 'RV_SV_1', 'Perioden er avslått på grunn av at inntekt er under krav til minste sykepengegrunnlag', 'Alle dager er avvist på grunn av at sykepengegrunnlaget er under minstekrav', 'Undersøk at sykepengegrunnlaget er korrekt. Hvis det er fastsatt korrekt kan saken godkjennes i speil, da må avslagsbrev sendes i infotrygd.', 'false', '1970-01-01 00:00:00.000000') ON CONFLICT(unik_id) DO NOTHING;
            INSERT INTO api_varseldefinisjon (unik_id, kode, tittel, forklaring, handling, avviklet, opprettet) VALUES ('cf026105-295e-46fe-bf46-c0b6da6db8c9', 'RV_OV_1', 'Perioden er avslått på grunn av manglende opptjening', 'Alle dager er avvist på grunn av at personen ikke har jobbet mer enn fire uker før sykmeldingstidspunktet', 'Undersøk at opptjeningen er vurdert riktig. Hvis opptjening ikke er oppfylt kan saken godkjennes i speil og det må sendes avslagsbrev i Infotrygd.', 'false', '1970-01-01 00:00:00.000000') ON CONFLICT(unik_id) DO NOTHING;
            INSERT INTO api_varseldefinisjon (unik_id, kode, tittel, forklaring, handling, avviklet, opprettet) VALUES ('1bd24132-c425-48af-9bbb-6021fd7ac207', 'RV_IT_28', 'Perioden er en direkte overgang fra periode i Infotrygd', null, null, 'true', '1970-01-01 00:00:00.000000') ON CONFLICT(unik_id) DO NOTHING;
            INSERT INTO api_varseldefinisjon (unik_id, kode, tittel, forklaring, handling, avviklet, opprettet) VALUES ('88936692-a5e8-4ab9-9d36-b3df9a9bcf71', 'RV_IT_29', 'Perioden er lagt inn i Infotrygd - men mangler inntektsopplysninger. Fjern perioden fra SP UB hvis du utbetaler via speil.', null, null, 'true', '1970-01-01 00:00:00.000000') ON CONFLICT(unik_id) DO NOTHING;
            INSERT INTO api_varseldefinisjon (unik_id, kode, tittel, forklaring, handling, avviklet, opprettet) VALUES ('7e6efbb1-68c3-4196-86f2-12a87fe4702f', 'RV_IT_30', 'Perioden er lagt inn i Infotrygd, men ikke utbetalt. Fjern fra Infotrygd hvis det utbetales via speil.', 'Det ligger registrert en søknad om sykepenger på SP UB.', 'Dette varselet betyr ikke at perioden må behandles i Infotrygd. Fjern perioden fra SP UB når du utbetaler via speil. Hvis inntekten er registert så kan den slettes på SP-VT. Hvis det er en forutgående periode i Infotrygd som enda ikke er behandlet, trenger du ikke å avvise perioden hvis det er flere sykepengedager igjen er enn det som ligger til behandling i Infotrygd.', 'true', '1970-01-01 00:00:00.000000') ON CONFLICT(unik_id) DO NOTHING;
            INSERT INTO api_varseldefinisjon (unik_id, kode, tittel, forklaring, handling, avviklet, opprettet) VALUES ('5d4e4e27-e97a-4669-89d2-1d44409e293a', 'RV_IT_31', 'Perioden forlenger en behandling i Infotrygd, og har historikk fra ny løsning: Undersøk at antall dager igjen er beregnet riktig.', null, null, 'true', '1970-01-01 00:00:00.000000') ON CONFLICT(unik_id) DO NOTHING;
            INSERT INTO api_varseldefinisjon (unik_id, kode, tittel, forklaring, handling, avviklet, opprettet) VALUES ('b81f0025-b65a-49b0-a4fa-a1308ffccebd', 'RV_IT_31', 'Perioden forlenger en behandling i Infotrygd, og har historikk i ny løsning også: Undersøk at antall dager igjen er beregnet riktig.', null, null, 'true', '1970-01-01 00:00:00.000000') ON CONFLICT(unik_id) DO NOTHING;
            INSERT INTO api_varseldefinisjon (unik_id, kode, tittel, forklaring, handling, avviklet, opprettet) VALUES ('0c62d005-d31e-4e96-8ad3-dd235cd05fc8', 'RV_IT_32', 'Perioden forlenger en behandling i ny løsning, og har historikk i Infotrygd også: Undersøk at antall dager igjen er beregnet riktig.', null, null, 'true', '1970-01-01 00:00:00.000000') ON CONFLICT(unik_id) DO NOTHING;
            INSERT INTO api_varseldefinisjon (unik_id, kode, tittel, forklaring, handling, avviklet, opprettet) VALUES ('172dae1b-a3be-41ff-a9bb-a6d0d38407b7', 'RV_SØ_25', 'Permisjon oppgitt i perioden i søknaden.', 'Det skal ikke utbetales sykepenger under permisjon.', 'Retten til sykepenger skal vurderes dersom permisjonen er lengre enn 14 dager. Vurder å sende vedtaksbrev fra Infotrygd.', 'true', '1970-01-01 00:00:00.000000') ON CONFLICT(unik_id) DO NOTHING;
            INSERT INTO api_varseldefinisjon (unik_id, kode, tittel, forklaring, handling, avviklet, opprettet) VALUES ('7e73166b-112f-429f-8d5d-924f88f6064f', 'RV_SØ_25', 'Permisjon oppgitt i perioden i søknaden. Vurder rett til sykepenger og korriger sykmeldingsperioden', null, null, 'true', '1970-01-01 00:00:00.000000') ON CONFLICT(unik_id) DO NOTHING;
            INSERT INTO api_varseldefinisjon (unik_id, kode, tittel, forklaring, handling, avviklet, opprettet) VALUES ('1fc947d8-4d36-4cca-9416-9bd3829ede1a', 'RV_IT_15', 'Personen er ikke registrert som normal arbeidstaker i Infotrygd', 'Denne sakstypen tas normalt ikke inn i Speil. Det kan ha skjedd en endring fra saken ble behandlet første gang til den nå skal revurderes.', 'Undersøk om saken kan revurderes i Speil og at utbetalingen blir riktig. Hvis saken ikke kan revurderes i Speil, må du annullere og behandle saken i Infotrygd.', 'false', '1970-01-01 00:00:00.000000') ON CONFLICT(unik_id) DO NOTHING;
            INSERT INTO api_varseldefinisjon (unik_id, kode, tittel, forklaring, handling, avviklet, opprettet) VALUES ('67b05351-a4d3-4a85-b718-0411805c1818', 'SB_IK_1', 'Registert fullmakt på personen.', 'Dette kan bety at noen andre representerer denne personen', 'Undersøk hva fullmakten innebærer, hvem som er fullmaktshaver, hvem som skal ha orientering om vedtak og om personen hadde rett til å søke på egne vegne.', 'true', '1970-01-01 00:00:00.000000') ON CONFLICT(unik_id) DO NOTHING;
            INSERT INTO api_varseldefinisjon (unik_id, kode, tittel, forklaring, handling, avviklet, opprettet) VALUES ('91737d53-a1d1-4c21-8a3a-973e03f36292', 'RV_RV_4', 'Revurdering er igangsatt og må fullføres', null, null, 'true', '1970-01-01 00:00:00.000000') ON CONFLICT(unik_id) DO NOTHING;
            INSERT INTO api_varseldefinisjon (unik_id, kode, tittel, forklaring, handling, avviklet, opprettet) VALUES ('15715a5b-9bfa-4d1e-93c1-1f4615bcb0c1', 'RV_OO_2', 'Saken må revurderes fordi det har blitt behandlet en tidligere periode som kan ha betydning.', 'Det har blitt behandlet en søknadsperiode som gjelder et tidligere tidsrom. Dette kan medføre at antall forbrukte dager er endret eller at opptjening av ny rett til sykepenger påvirkes.', 'Sjekk at telling av forbrukte dager og/eller opptjening av ny rett er riktig beregnet. Dersom revurderingen gjør at det er for mye utbetalt til den sykmeldte, se egne rutiner for håndtering av feilutbetalinger.', 'false', '1970-01-01 00:00:00.000000') ON CONFLICT(unik_id) DO NOTHING;
            INSERT INTO api_varseldefinisjon (unik_id, kode, tittel, forklaring, handling, avviklet, opprettet) VALUES ('9f519bd1-f6f4-4ffb-b3c2-b18f442c6854', 'RV_SI_2', 'Simulering av revurdert utbetaling feilet. Utbetalingen må annulleres', null, null, 'false', '1970-01-01 00:00:00.000000') ON CONFLICT(unik_id) DO NOTHING;
            INSERT INTO api_varseldefinisjon (unik_id, kode, tittel, forklaring, handling, avviklet, opprettet) VALUES ('8f4092a0-9263-438b-83d2-e148bcbcfd0a', 'RV_SI_5', 'Simulering har endret dagsats eller antall på én eller flere utbetalingslinjer', null, null, 'true', '1970-01-01 00:00:00.000000') ON CONFLICT(unik_id) DO NOTHING;
            INSERT INTO api_varseldefinisjon (unik_id, kode, tittel, forklaring, handling, avviklet, opprettet) VALUES ('1464e9b9-648c-475a-868a-2fc64c1b59e5', 'RV_SI_6', 'Simulering inneholder ikke alle periodene som skal betales', 'Perioder som  anvises mangler i simuleringen', 'Send saken til manuell behandling i Infotrygd.', 'true', '1970-01-01 00:00:00.000000') ON CONFLICT(unik_id) DO NOTHING;
            INSERT INTO api_varseldefinisjon (unik_id, kode, tittel, forklaring, handling, avviklet, opprettet) VALUES ('8acd7feb-bfa7-42d1-9c8e-f1bc9f21ebea', 'RV_SI_7', 'Simulering kom frem til et annet totalbeløp', null, null, 'true', '1970-01-01 00:00:00.000000') ON CONFLICT(unik_id) DO NOTHING;
            INSERT INTO api_varseldefinisjon (unik_id, kode, tittel, forklaring, handling, avviklet, opprettet) VALUES ('f1f6d48d-58e5-4c5f-b7ab-40bf595a2e82', 'RV_SI_7', 'Simulering kom frem til et annet totalbeløp. Kontroller beløpet til utbetaling', null, null, 'true', '1970-01-01 00:00:00.000000') ON CONFLICT(unik_id) DO NOTHING;
            INSERT INTO api_varseldefinisjon (unik_id, kode, tittel, forklaring, handling, avviklet, opprettet) VALUES ('2462c8f6-2541-48f1-b586-82d5b09672b1', 'RV_VV_16', 'Søknaden inneholder egenmeldingsdager som ikke er oppgitt i inntektsmeldingen', null, null, 'true', '1970-01-01 00:00:00.000000') ON CONFLICT(unik_id) DO NOTHING;
            INSERT INTO api_varseldefinisjon (unik_id, kode, tittel, forklaring, handling, avviklet, opprettet) VALUES ('79521a3f-98cf-4c6f-8085-b3332be7f32e', 'RV_VV_16', 'Søknaden inneholder egenmeldingsdager som ikke er oppgitt i inntektsmeldingen. Vurder om arbeidsgiverperioden beregnes riktig', 'Egenmeldingsdager er ikke oppgitt i inntektsmeldingen, men i søknaden', 'Sjekk om arbeidsgiver har oppgitt riktig arbeidsgiverperioden.', 'true', '1970-01-01 00:00:00.000000') ON CONFLICT(unik_id) DO NOTHING;
            INSERT INTO api_varseldefinisjon (unik_id, kode, tittel, forklaring, handling, avviklet, opprettet) VALUES ('6c6c66e0-b468-4103-91a3-d53195a0753c', 'RV_SØ_26', 'Søknaden inneholder Feriedager utenfor perioden søknaden gjelder for', 'I søknadsdialogen så blir den sykmeldte spurt om det er ferie i mellomliggende periode. Dette for å finne ut om to perioder hører sammen og om man trenger inntektsmelding.', 'Undersøk om perioden blir riktig beregnet.', 'true', '1970-01-01 00:00:00.000000') ON CONFLICT(unik_id) DO NOTHING;
            INSERT INTO api_varseldefinisjon (unik_id, kode, tittel, forklaring, handling, avviklet, opprettet) VALUES ('36796b91-c9b5-4985-8ba7-324589173473', 'RV_SØ_1', 'Søknaden inneholder permittering - se om det har innvirkning på saken før du utbetaler', null, null, 'false', '1970-01-01 00:00:00.000000') ON CONFLICT(unik_id) DO NOTHING;
            INSERT INTO api_varseldefinisjon (unik_id, kode, tittel, forklaring, handling, avviklet, opprettet) VALUES ('b65034d5-bde3-41ac-8320-2497a77fe04b', 'RV_SØ_1', 'Søknaden inneholder permittering. Vurder om permittering har konsekvens for rett til sykepenger', 'Bruker har oppgitt permittering på søknad om sykepenger', 'Kontrollér at permitteringen ikke påvirker sykepengerettighetene', 'false', '1970-01-01 00:00:00.000000') ON CONFLICT(unik_id) DO NOTHING;
            INSERT INTO api_varseldefinisjon (unik_id, kode, tittel, forklaring, handling, avviklet, opprettet) VALUES ('d626b9b0-271a-489b-9f40-da59d89f0df5', 'RV_IT_13', 'Støtter ikke overgang fra infotrygd for flere arbeidsgivere', 'Denne sakstypen tas normalt ikke inn i Speil. Det kan ha skjedd en endring fra saken ble behandlet første gang til den nå skal revurderes.', 'Undersøk om saken kan revurderes i Speil og at utbetalingen blir riktig. Hvis saken ikke kan revurderes i Speil, må du annullere og behandle saken i Infotrygd.', 'false', '1970-01-01 00:00:00.000000') ON CONFLICT(unik_id) DO NOTHING;
            INSERT INTO api_varseldefinisjon (unik_id, kode, tittel, forklaring, handling, avviklet, opprettet) VALUES ('170db9a9-ef8a-4017-90d1-29b322c79b31', 'RV_SØ_3', 'Sykmeldingen er tilbakedatert, vurder fra og med dato for utbetaling.', 'Sykmeldingen er tilbakedatert.', 'Hvis tilbakedateringen er godkjent, skal du finne notat i Gosys eller stå i fritekstfelt på SP-UB. Da kan du godkjenne saken i Speil. Hvis tilbakedateringen er under vurdering, skal det være en åpen Gosys-oppgave. I slike tilfeller skal du legge saken på vent til vurderingen er ferdig. Hvis tilbakedateringen er avslått, skal du avvise saken i Speil og sende vedtak. Registerer avslaget i SP-SA. Husk også å lukke oppgaven på søknaden/inntektsmeldingen i Gosys.', 'false', '1970-01-01 00:00:00.000000') ON CONFLICT(unik_id) DO NOTHING;
            INSERT INTO api_varseldefinisjon (unik_id, kode, tittel, forklaring, handling, avviklet, opprettet) VALUES ('f6519b9f-ede8-4e4d-bb8e-0f7f767bcf83', 'RV_UT_1', 'Utbetaling av revurdert periode ble avvist av saksbehandler. Utbetalingen må annulleres', null, null, 'false', '1970-01-01 00:00:00.000000') ON CONFLICT(unik_id) DO NOTHING;
            INSERT INTO api_varseldefinisjon (unik_id, kode, tittel, forklaring, handling, avviklet, opprettet) VALUES ('46035cf7-1076-4eb9-a917-6e85fa30703d', 'RV_UT_20', 'Utbetaling fra og med dato er endret. Kontroller simuleringen', null, null, 'true', '1970-01-01 00:00:00.000000') ON CONFLICT(unik_id) DO NOTHING;
            INSERT INTO api_varseldefinisjon (unik_id, kode, tittel, forklaring, handling, avviklet, opprettet) VALUES ('83f03932-38f7-45f5-9123-8f7e1c456093', 'RV_IT_3', 'Utbetaling i Infotrygd overlapper med vedtaksperioden', 'Denne sakstypen tas normalt ikke inn i Speil. Det kan ha skjedd en endring fra saken ble behandlet første gang til den nå skal revurderes.', 'Undersøk om saken kan revurderes i Speil og at utbetalingen blir riktig. Hvis saken ikke kan revurderes i Speil, må du annullere og behandle saken i Infotrygd.', 'false', '1970-01-01 00:00:00.000000') ON CONFLICT(unik_id) DO NOTHING;
            INSERT INTO api_varseldefinisjon (unik_id, kode, tittel, forklaring, handling, avviklet, opprettet) VALUES ('c09bc38d-2eff-4c28-b5bf-cb625e5d8b1b', 'RV_OS_1', 'Utbetalingen forlenger et tidligere oppdrag som opphørte alle utbetalte dager. Sjekk simuleringen.', null, null, 'false', '1970-01-01 00:00:00.000000') ON CONFLICT(unik_id) DO NOTHING;
            INSERT INTO api_varseldefinisjon (unik_id, kode, tittel, forklaring, handling, avviklet, opprettet) VALUES ('cea67e54-d0f0-4021-b4d3-9f4b67b82c28', 'RV_OS_2', 'Utbetalingens fra og med-dato er endret. Kontroller simuleringen', null, null, 'false', '1970-01-01 00:00:00.000000') ON CONFLICT(unik_id) DO NOTHING;
            INSERT INTO api_varseldefinisjon (unik_id, kode, tittel, forklaring, handling, avviklet, opprettet) VALUES ('386b023a-f9d0-4656-8704-7e5c79e9e7ac', 'RV_SØ_4', 'Utdanning oppgitt i perioden i søknaden.', null, null, 'false', '1970-01-01 00:00:00.000000') ON CONFLICT(unik_id) DO NOTHING;
            INSERT INTO api_varseldefinisjon (unik_id, kode, tittel, forklaring, handling, avviklet, opprettet) VALUES ('6de7c31b-232f-47e0-8907-cb31bd8e2b55', 'RV_SØ_4', 'Utdanning oppgitt i perioden i søknaden. Vurder rett til sykepenger og korriger sykmeldingsperioden', null, null, 'false', '1970-01-01 00:00:00.000000') ON CONFLICT(unik_id) DO NOTHING;
            INSERT INTO api_varseldefinisjon (unik_id, kode, tittel, forklaring, handling, avviklet, opprettet) VALUES ('c2213ea9-9238-4909-8a1d-64982eb2405c', 'RV_SØ_8', 'Utenlandsopphold oppgitt i perioden i søknaden.', 'Det er oppgitt utenlandsopphold utenfor EØS i søknaden', 'Undersøk om det er vedtak om beholde sykepenger under utenlandsopphold. Hvis det er søkt uten at det er behandlet - legg saken på vent til det foreligger vedtak i saken. Korriger dager dersom det er gitt avslag - og godkjenn saken i ny løsning. Hvis brukeren har fått vedtak fra NAV-kontoret, trenger du ikke å sende nytt vedtak.', 'false', '1970-01-01 00:00:00.000000') ON CONFLICT(unik_id) DO NOTHING;
            INSERT INTO api_varseldefinisjon (unik_id, kode, tittel, forklaring, handling, avviklet, opprettet) VALUES ('dad1f581-f290-4cf4-9359-9ceecc8e16c1', 'RV_SØ_8', 'Utenlandsopphold oppgitt i perioden i søknaden. Vurder rett til sykepenger og korriger sykmeldingperioden', null, null, 'false', '1970-01-01 00:00:00.000000') ON CONFLICT(unik_id) DO NOTHING;
            INSERT INTO api_varseldefinisjon (unik_id, kode, tittel, forklaring, handling, avviklet, opprettet) VALUES ('960a8553-d5e1-4efd-b155-e17e5ef8ba8f', 'RV_RV_5', 'Validering av ytelser ved revurdering feilet. Utbetalingen må annulleres', null, null, 'true', '1970-01-01 00:00:00.000000') ON CONFLICT(unik_id) DO NOTHING;
            INSERT INTO api_varseldefinisjon (unik_id, kode, tittel, forklaring, handling, avviklet, opprettet) VALUES ('957209b4-c73b-4b1a-8927-5471c7634b7f', 'RV_IM_1', 'Vi har mottatt en inntektsmelding i en løpende sykmeldingsperiode med oppgitt første/bestemmende fraværsdag som er ulik tidligere fastsatt skjæringstidspunkt.', 'Det kan bety at den sykmeldte har gjenopptatt arbeidet og så blitt sykmeldt igjen. Det kan derfor være et nytt skjæringstidspunkt.', 'Undersøk om arbeidet er gjenopptatt slik at sykmeldingen avbrytes. Det må avklares om det blir et nytt skjæringstidspunkt. Hvis det blir nytt skjæringstidspunkt, må perioden med det nye skjæringstidspunktet avvises i vedtaksløsningen og saken må behandles i Infotrygd.', 'false', '1970-01-01 00:00:00.000000') ON CONFLICT(unik_id) DO NOTHING;
            INSERT INTO api_varseldefinisjon (unik_id, kode, tittel, forklaring, handling, avviklet, opprettet) VALUES ('288774e9-0e0e-48fc-9893-405974af4963', 'RV_MV_1', 'Vurder lovvalg og medlemskap', 'Medlemskapssjekken har ikke klart å entydig konkludere med at bruker er medlem', 'Sjekk om personen er medlem i folketrygden – se i medlemskapsfanen i Gosys. Sjekk bostedsadressen og hvor arbeidet utføres. Hvis bokommune er 0393 eller 2101 skal saken avvises og behandles av NAV Utland. Kilder: Gosys og Aa-registeret.', 'false', '1970-01-01 00:00:00.000000') ON CONFLICT(unik_id) DO NOTHING;
            INSERT INTO api_varseldefinisjon (unik_id, kode, tittel, forklaring, handling, avviklet, opprettet) VALUES ('e64d5b2e-4081-43ae-afea-25e44a606753', 'SB_RV_3', 'Arbeidsuførhet, aktivitetsplikt og/eller medvirkning må vurderes. Klarte ikke gjøre automatisk 8-4-vurdering p.g.a. teknisk feil. Kan godkjennes hvis alt ser greit ut.', null, null, 'false', '1970-01-01 00:00:00.000000') ON CONFLICT(unik_id) DO NOTHING;
