            INSERT INTO api_varseldefinisjon (unik_id, kode, tittel, forklaring, handling, avviklet, opprettet) VALUES ('7ee826e0-befd-4e9b-8c14-d766a7eb9c21', 'SB_RV_2', 'Arbeidsuførhet, aktivitetsplikt og/eller medvirkning må vurderes. Veilederen har stanset automatisk behandling (årsak: medisinsk vilkår). Se Gosys for mer informasjon. Symptomdiagnose ved 15 uker. Vurder arbeidsuførhet.', null, null, 'false', '1970-01-01 00:00:00.000000') ON CONFLICT(unik_id) DO NOTHING;
            INSERT INTO api_varseldefinisjon (unik_id, kode, tittel, forklaring, handling, avviklet, opprettet) VALUES ('381fbddc-bc1e-4d45-b5df-0095501d2b50', 'SB_RV_2', 'Arbeidsuførhet, aktivitetsplikt og/eller medvirkning må vurderes. Veilederen har stanset automatisk behandling (årsak: tilbakedatert sykmelding). Se Gosys for mer informasjon.', null, null, 'false', '1970-01-01 00:00:00.000000') ON CONFLICT(unik_id) DO NOTHING;
            INSERT INTO api_varseldefinisjon (unik_id, kode, tittel, forklaring, handling, avviklet, opprettet) VALUES ('5e1cc26d-2fdd-49cf-a1a6-b35b3c4183ab', 'SB_RV_2', 'Arbeidsuførhet, aktivitetsplikt og/eller medvirkning må vurderes. Se forklaring på vilkårs-siden.', 'Den nye løsningen finner uklarheter i et eller flere av disse vilkårene.', 'Sjekk saken nøye og vurder om den skal sendes lokalt kontor for nærmere vurdering om arbeidsuførhet.', 'false', '1970-01-01 00:00:00.000000') ON CONFLICT(unik_id) DO NOTHING;
            INSERT INTO api_varseldefinisjon (unik_id, kode, tittel, forklaring, handling, avviklet, opprettet) VALUES ('9af57aa9-e3d0-4171-a551-fd8a5e070601', 'RV_SØ_21', 'Bruker har oppgitt at de har jobbet mindre enn sykmelding tilsier', null, null, 'true', '2022-11-30 18:25:06.305606') ON CONFLICT(unik_id) DO NOTHING;
            INSERT INTO api_varseldefinisjon (unik_id, kode, tittel, forklaring, handling, avviklet, opprettet) VALUES ('6e59128a-fb09-465b-aa3a-220b20ff4a25', 'RV_UT_21', 'Utbetalingen opphører tidligere utbetaling.', null, null, 'true', '1970-01-01 00:00:00.000000') ON CONFLICT(unik_id) DO NOTHING;
            INSERT INTO api_varseldefinisjon (unik_id, kode, tittel, forklaring, handling, avviklet, opprettet) VALUES ('858964ac-66a7-43cd-a167-3aa15990cd3c', 'RV_SØ_10', 'Den sykmeldte har fått et nytt arbeidsforhold.', 'Den sykmeldte har oppgitt i søknaden at han/hun har fått et nytt arbeidsforhold i sykmeldingsperioden.', 'Du må sjekke om sykepengene skal graderes ut ifra inntekt i det nye arbeidsforholdet. Du må kontakte bruker for å få informasjon om inntekten og når den er opptjent. Ta stilling til om det bør sendes en oppgave til NAV-kontoret for vurdering av vilkårene i § 8-4.', 'false', '2022-11-16 00:00:00.000000') ON CONFLICT(unik_id) DO NOTHING;
            INSERT INTO api_varseldefinisjon (unik_id, kode, tittel, forklaring, handling, avviklet, opprettet) VALUES ('d728672c-91a2-493b-9633-945cc4d82a4a', 'RV_IM_4', 'Mottatt flere inntektsmeldinger - den første inntektsmeldingen som ble mottatt er lagt til grunn. Utbetal kun hvis det blir korrekt.', null, null, 'false', '2022-11-30 18:11:06.291785') ON CONFLICT(unik_id) DO NOTHING;
            INSERT INTO api_varseldefinisjon (unik_id, kode, tittel, forklaring, handling, avviklet, opprettet) VALUES ('7e210c87-b894-4c8d-a779-2560ea1ef3db', 'RV_OO_1', 'Det er behandlet en søknad i Speil for en senere periode enn denne.', 'Søknadene har ikke kommet i vanlig rekkefølge. Dette kan skje dersom den sykmeldte avbryter en søknad/sykmelding, eller en lege skriver ut en tilbakedatert sykmelding. Perioder som allerede er avsluttet vil revurderes når denne perioden godkjennes.', 'Undersøk at behandlingen av perioden blir riktig.', 'false', '2022-11-30 18:25:06.305606') ON CONFLICT(unik_id) DO NOTHING;
            INSERT INTO api_varseldefinisjon (unik_id, kode, tittel, forklaring, handling, avviklet, opprettet) VALUES ('d33dcce6-267a-481e-97ae-c52b7565de7c', 'RV_OO_2', 'Saken må revurderes fordi det har blitt behandlet en tidligere periode som kan ha betydning.', 'Det har blitt behandlet en søknadsperiode som gjelder et tidligere tidsrom. Dette kan medføre at antall forbrukte dager er endret eller at opptjening av ny rett til sykepenger påvirkes.', 'Sjekk at telling av forbrukte dager og/eller opptjening av ny rett er riktig beregnet. Dersom revurderingen gjør at det er for mye utbetalt til den sykmeldte, se egne rutiner for håndtering av feilutbetalinger.', 'false', '2022-11-30 18:25:06.305606') ON CONFLICT(unik_id) DO NOTHING;
            INSERT INTO api_varseldefinisjon (unik_id, kode, tittel, forklaring, handling, avviklet, opprettet) VALUES ('db5f0406-07bc-4598-b908-167d67900c7f', 'RV_IM_1', 'Vi har mottatt en inntektsmelding i en løpende sykmeldingsperiode med oppgitt første/bestemmende fraværsdag som er ulik tidligere fastsatt skjæringstidspunkt.', 'Det kan bety at den sykmeldte har gjenopptatt arbeidet og så blitt sykmeldt igjen. Det kan derfor være et nytt skjæringstidspunkt.', 'Undersøk om arbeidet er gjenopptatt slik at sykmeldingen avbrytes. Det må avklares om det blir et nytt skjæringstidspunkt. Hvis det blir nytt skjæringstidspunkt, må perioden med det nye skjæringstidspunktet avvises i vedtaksløsningen og saken må behandles i Infotrygd.', 'false', '2022-11-30 18:25:06.305606') ON CONFLICT(unik_id) DO NOTHING;
            INSERT INTO api_varseldefinisjon (unik_id, kode, tittel, forklaring, handling, avviklet, opprettet) VALUES ('a28d60e4-bca4-4f49-be44-60ed01baac4f', 'RV_IM_2', 'Første fraværsdag i inntektsmeldingen er ulik skjæringstidspunktet. Kontrollér at inntektsmeldingen er knyttet til riktig periode.', 'Første fraværsdag i inntektsmeldingen er ulik første fraværsdag i sykdomsperioden:', 'Kontroller at skjæringstidspunktet er riktig.', 'false', '2022-11-30 18:25:06.305606') ON CONFLICT(unik_id) DO NOTHING;
            INSERT INTO api_varseldefinisjon (unik_id, kode, tittel, forklaring, handling, avviklet, opprettet) VALUES ('a86bf241-1707-4844-aac9-ea0b6c4a23b1', 'RV_IM_3', 'Inntektsmeldingen og vedtaksløsningen er uenige om beregningen av arbeidsgiverperioden. Undersøk hva som er riktig arbeidsgiverperiode.', 'Arbeidsgiver og vedtaksløsningen har beregnet arbeidsgiverperioden ulikt.', 'Vurder hva som er riktig arbeidsgiverperiode. Hvis forslaget til vedtaksløsningen er feil, må saken behandles i Infotrygd.', 'false', '2022-11-30 18:25:06.305606') ON CONFLICT(unik_id) DO NOTHING;
            INSERT INTO api_varseldefinisjon (unik_id, kode, tittel, forklaring, handling, avviklet, opprettet) VALUES ('2abd964f-d951-40c5-b8e8-8e7b445a29b1', 'RV_IM_5', 'Sykmeldte har oppgitt ferie første dag i arbeidsgiverperioden.', null, null, 'false', '2022-11-30 18:25:06.305606') ON CONFLICT(unik_id) DO NOTHING;
            INSERT INTO api_varseldefinisjon (unik_id, kode, tittel, forklaring, handling, avviklet, opprettet) VALUES ('638d80d7-bd22-4277-8dec-ca1ba6d75692', 'RV_IM_6', 'Inntektsmelding inneholder ikke beregnet inntekt', null, null, 'false', '2022-11-30 18:25:06.305606') ON CONFLICT(unik_id) DO NOTHING;
            INSERT INTO api_varseldefinisjon (unik_id, kode, tittel, forklaring, handling, avviklet, opprettet) VALUES ('1fe68457-e877-4584-b336-a1e44579d21a', 'RV_IM_7', 'Brukeren har opphold i naturalytelser', null, null, 'false', '2022-11-30 18:25:06.305606') ON CONFLICT(unik_id) DO NOTHING;
            INSERT INTO api_varseldefinisjon (unik_id, kode, tittel, forklaring, handling, avviklet, opprettet) VALUES ('fe90113f-5cb2-4849-9805-58b5a7202524', 'RV_RE_1', 'Fant ikke refusjonsgrad for perioden. Undersøk oppgitt refusjon før du utbetaler.', 'Fant ikke informasjon om det er refusjon i perioden. Refusjonen er satt til 100 % siden det samsvarer med siste utbetalte periode i Infotrygd.', 'Undersøk hva som er oppgitt i siste inntektsmelding og eventuell informasjon i Infotrygd. Dersom refusjonen er satt feil må perioden behandles i Infotrygd.', 'false', '2022-11-30 18:25:06.305606') ON CONFLICT(unik_id) DO NOTHING;
            INSERT INTO api_varseldefinisjon (unik_id, kode, tittel, forklaring, handling, avviklet, opprettet) VALUES ('4d8a4ccd-9673-481d-add6-7214e2b1068b', 'RV_IT_1', 'Det er utbetalt en periode i Infotrygd etter perioden du skal behandle nå. Undersøk at antall forbrukte dager og grunnlag i Infotrygd er riktig', null, null, 'false', '2022-11-30 18:25:06.305606') ON CONFLICT(unik_id) DO NOTHING;
            INSERT INTO api_varseldefinisjon (unik_id, kode, tittel, forklaring, handling, avviklet, opprettet) VALUES ('7203f642-e1db-4f48-95c5-857b0e2da6ed', 'RV_IT_2', 'Perioden er lagt inn i Infotrygd, men ikke utbetalt. Fjern fra Infotrygd hvis det utbetales via speil.', 'Det ligger registrert en søknad om sykepenger på SP UB.', 'Dette varselet betyr ikke at perioden må behandles i Infotrygd. Fjern perioden fra SP UB når du utbetaler via speil. Hvis inntekten er registert så kan den slettes på SP-VT. Hvis det er en forutgående periode i Infotrygd som enda ikke er behandlet, trenger du ikke å avvise perioden hvis det er flere sykepengedager igjen er enn det som ligger til behandling i Infotrygd.', 'true', '2022-11-30 18:25:06.305606') ON CONFLICT(unik_id) DO NOTHING;
            INSERT INTO api_varseldefinisjon (unik_id, kode, tittel, forklaring, handling, avviklet, opprettet) VALUES ('474667b7-c3cf-4896-bc5b-99f5bf7fc766', 'RV_SØ_3', 'Sykmeldingen er tilbakedatert, vurder fra og med dato for utbetaling.', 'Sykmeldingen er tilbakedatert.', 'Hvis tilbakedateringen er godkjent, skal du finne notat i Gosys eller stå i fritekstfelt på SP-UB. Da kan du godkjenne saken i Speil. Hvis tilbakedateringen er under vurdering, skal det være en åpen Gosys-oppgave. I slike tilfeller skal du legge saken på vent til vurderingen er ferdig. Hvis tilbakedateringen er avslått, skal du avvise saken i Speil og sende vedtak. Registerer avslaget i SP-SA. Husk også å lukke oppgaven på søknaden/inntektsmeldingen i Gosys.', 'false', '2022-11-30 18:25:06.305606') ON CONFLICT(unik_id) DO NOTHING;
            INSERT INTO api_varseldefinisjon (unik_id, kode, tittel, forklaring, handling, avviklet, opprettet) VALUES ('881ca7f5-993f-4705-b203-32e752af3e6e', 'RV_SØ_4', 'Utdanning oppgitt i perioden i søknaden.', null, null, 'false', '2022-11-30 18:25:06.305606') ON CONFLICT(unik_id) DO NOTHING;
            INSERT INTO api_varseldefinisjon (unik_id, kode, tittel, forklaring, handling, avviklet, opprettet) VALUES ('9c3cfa0a-3cf3-4e94-9a38-3bf86ae8be2e', 'RV_SØ_5', 'Søknaden inneholder Permisjonsdager utenfor sykdomsvindu', null, null, 'false', '2022-11-30 18:25:06.305606') ON CONFLICT(unik_id) DO NOTHING;
            INSERT INTO api_varseldefinisjon (unik_id, kode, tittel, forklaring, handling, avviklet, opprettet) VALUES ('67d356e0-c78a-44fb-beba-a9444e2ecfa1', 'RV_SØ_6', 'Søknaden inneholder egenmeldingsdager etter sykmeldingsperioden', 'Det foreligger egenmeldingsdager etter sykmeldingsperioden', 'Egenmeldinger kan ikke benyttes rett etter en sykmelding, sjekk arbeidsgiverperioden og utbetalingsoversikten.', 'true', '2022-11-30 18:25:06.305606') ON CONFLICT(unik_id) DO NOTHING;
            INSERT INTO api_varseldefinisjon (unik_id, kode, tittel, forklaring, handling, avviklet, opprettet) VALUES ('92ee1281-a81d-4f75-b5d3-6e703022d338', 'RV_SØ_7', 'Søknaden inneholder Arbeidsdager utenfor sykdomsvindu', null, null, 'false', '2022-11-30 18:25:06.305606') ON CONFLICT(unik_id) DO NOTHING;
            INSERT INTO api_varseldefinisjon (unik_id, kode, tittel, forklaring, handling, avviklet, opprettet) VALUES ('5b438874-0168-4e37-8f89-70bc43317913', 'RV_SØ_8', 'Utenlandsopphold oppgitt i perioden i søknaden.', 'Det er oppgitt utenlandsopphold utenfor EØS i søknaden', 'Undersøk om det er vedtak om beholde sykepenger under utenlandsopphold. Hvis det er søkt uten at det er behandlet - legg saken på vent til det foreligger vedtak i saken. Korriger dager dersom det er gitt avslag - og godkjenn saken i ny løsning. Hvis brukeren har fått vedtak fra NAV-kontoret, trenger du ikke å sende nytt vedtak.', 'false', '2022-11-30 18:25:06.305606') ON CONFLICT(unik_id) DO NOTHING;
            INSERT INTO api_varseldefinisjon (unik_id, kode, tittel, forklaring, handling, avviklet, opprettet) VALUES ('df7a6b17-6768-41ed-be39-34f47206e4e8', 'RV_SØ_10', 'Den sykmeldte har fått et nytt inntektsforhold.', 'Den sykmeldte har oppgitt i søknaden at han/hun har fått et nytt inntektsforhold i sykmeldingsperioden.', 'Du må sjekke om sykepengene skal graderes ut ifra inntekt i det nye inntektsforholdet. Du må finne informasjon om inntekten og når den er opptjent. Ta stilling til om det bør sendes en oppgave til NAV-kontoret for vurdering av vilkårene i § 8-4.', 'false', '2022-11-30 18:25:06.305606') ON CONFLICT(unik_id) DO NOTHING;
            INSERT INTO api_varseldefinisjon (unik_id, kode, tittel, forklaring, handling, avviklet, opprettet) VALUES ('e0e2d3b3-d822-4bf6-8a43-155fd8c824b9', 'RV_IV_1', 'Bruker har flere inntektskilder de siste tre månedene enn arbeidsforhold som er oppdaget i Aa-registeret.', 'Bruker kan være frilanser.', 'Sjekk om bruker er kombinert arbeidstaker og frilanser. Hvis ja, send saken til Infotrygd.', 'false', '2022-11-30 18:25:06.305606') ON CONFLICT(unik_id) DO NOTHING;
            INSERT INTO api_varseldefinisjon (unik_id, kode, tittel, forklaring, handling, avviklet, opprettet) VALUES ('62980e6a-8e17-4035-ba81-84e826d77e28', 'RV_SV_2', 'Minst en arbeidsgiver inngår ikke i sykepengegrunnlaget', null, null, 'false', '2022-11-30 18:25:06.305606') ON CONFLICT(unik_id) DO NOTHING;
            INSERT INTO api_varseldefinisjon (unik_id, kode, tittel, forklaring, handling, avviklet, opprettet) VALUES ('1fe7ce20-d96b-48dd-87ea-ec115d20c80c', 'RV_IT_4', 'Det er registrert utbetaling på nødnummer', 'Denne sakstypen tas normalt ikke inn i Speil. Det kan ha skjedd en endring fra saken ble behandlet første gang til den nå skal revurderes.', 'Undersøk om saken kan revurderes i Speil og at utbetalingen blir riktig. Hvis saken ikke kan revurderes i Speil, må du annullere og behandle saken i Infotrygd.', 'false', '2022-11-30 18:25:06.305606') ON CONFLICT(unik_id) DO NOTHING;
            INSERT INTO api_varseldefinisjon (unik_id, kode, tittel, forklaring, handling, avviklet, opprettet) VALUES ('7c17e0ff-4d86-455a-a13c-3767c6e17577', 'RV_VV_3', 'Første utbetalingsdag er i Infotrygd og mellom 1. og 16. mai. Kontroller at riktig grunnbeløp er brukt.', 'Vi klarer ikke å lese riktig skjæringstidspunkt når saken har startet i Infotrygd. Vi må kontrollere at riktig grunnbeløp er brukt i saker med sykepengegrunnlag over 6G.', 'Kontroller at dagsatsen samsvarer med grunnbeløpet som skal brukes.', 'true', '2022-11-30 18:25:06.305606') ON CONFLICT(unik_id) DO NOTHING;
            INSERT INTO api_varseldefinisjon (unik_id, kode, tittel, forklaring, handling, avviklet, opprettet) VALUES ('045f0547-708e-47cb-85c2-fb98cb153c18', 'RV_VV_4', 'Minst én dag uten utbetaling på grunn av sykdomsgrad under 20 %. Vurder å sende vedtaksbrev fra Infotrygd', 'Minst én dag uten utbetaling på grunn av sykdomsgrad under 20', 'Dersom du er enig i vurderingen, send avslagsbrev fra Infotrygd og godkjenn i ny løsning. OBS!!: Hør med den som er sykmeldt hvis det er mistanke om misforståelser ved utfylling av søknaden. Da kan du sende spørsmål i Modia og legge saken på vent til du får svar.', 'false', '2022-11-30 18:25:06.305606') ON CONFLICT(unik_id) DO NOTHING;
            INSERT INTO api_varseldefinisjon (unik_id, kode, tittel, forklaring, handling, avviklet, opprettet) VALUES ('2a9e8d2a-3928-4d65-b615-830c5d081b0c', 'RV_VV_5', 'Bruker mangler nødvendig inntekt ved validering av Vilkårsgrunnlag', null, null, 'false', '2022-11-30 18:25:06.305606') ON CONFLICT(unik_id) DO NOTHING;
            INSERT INTO api_varseldefinisjon (unik_id, kode, tittel, forklaring, handling, avviklet, opprettet) VALUES ('595a1b4f-20ef-4ca3-85ba-30221eaac878', 'RV_OV_2', 'Opptjeningsvurdering må gjøres manuelt fordi opplysningene fra AA-registeret er ufullstendige', null, null, 'true', '2022-11-30 18:25:06.305606') ON CONFLICT(unik_id) DO NOTHING;
            INSERT INTO api_varseldefinisjon (unik_id, kode, tittel, forklaring, handling, avviklet, opprettet) VALUES ('d010f783-f48c-45aa-8652-9c88846d7020', 'RV_MV_1', 'Vurder lovvalg og medlemskap', 'Medlemskapssjekken har ikke klart å entydig konkludere med at bruker er medlem', 'Sjekk om personen er medlem i folketrygden – se i medlemskapsfanen i Gosys. Sjekk bostedsadressen og hvor arbeidet utføres. Hvis bokommune er 0393 eller 2101 skal saken avvises og behandles av NAV Utland. Kilder: Gosys og Aa-registeret.', 'false', '2022-11-30 18:25:06.305606') ON CONFLICT(unik_id) DO NOTHING;
            INSERT INTO api_varseldefinisjon (unik_id, kode, tittel, forklaring, handling, avviklet, opprettet) VALUES ('8348a7bd-74bc-4304-91ea-84cae01a757c', 'RV_MV_2', 'Perioden er avslått på grunn av at den sykmeldte ikke er medlem av Folketrygden', 'Alle dager er avvist på grunn av at personen ikke er medlem av Folketrygden', 'Undersøk om det er riktig at personen ikke er medlem av Folketrygden. Hvis personen ikke er medlem kan saken godkjennes i speil og det må sendes vedtak i Infotrygd.', 'false', '2022-11-30 18:25:06.305606') ON CONFLICT(unik_id) DO NOTHING;
            INSERT INTO api_varseldefinisjon (unik_id, kode, tittel, forklaring, handling, avviklet, opprettet) VALUES ('9d2e5fe2-9074-42e9-9967-5357d03d2c27', 'RV_IV_2', 'Har mer enn 25 % avvik. Dette støttes foreløpig ikke i Speil. Du må derfor annullere periodene.', 'Det er lagt inn en ny inntekt som gir 25 % avvik. Skjønnsmessig fastsettelse av sykepengegrunnlaget støttes ikke i Speil.', 'Du kan endre inntekten en gang til hvis du har gjort noe feil. Dersom endringen skal gjennomføres må periodene annulleres i Speil og behandles i Infotrygd.', 'false', '2022-11-30 18:25:06.305606') ON CONFLICT(unik_id) DO NOTHING;
            INSERT INTO api_varseldefinisjon (unik_id, kode, tittel, forklaring, handling, avviklet, opprettet) VALUES ('f732531b-2f2c-4fa0-add5-c152fdbac7ce', 'RV_IV_3', 'Fant frilanserinntekt på en arbeidsgiver de siste 3 månedene', null, null, 'false', '2022-11-30 18:25:06.305606') ON CONFLICT(unik_id) DO NOTHING;
            INSERT INTO api_varseldefinisjon (unik_id, kode, tittel, forklaring, handling, avviklet, opprettet) VALUES ('fbf8119c-4dd6-40d1-aa9b-80517964e1ed', 'RV_AY_3', 'Bruker har mottatt AAP innenfor 6 måneder før skjæringstidspunktet. Kontroller at brukeren har rett til sykepenger', 'Bruker har mottatt AAP innenfor 6 måneder før skjæringstidspunktet', 'Kontrollér ny opptjeningstid etter maksdato', 'false', '2022-11-30 18:25:06.305606') ON CONFLICT(unik_id) DO NOTHING;
            INSERT INTO api_varseldefinisjon (unik_id, kode, tittel, forklaring, handling, avviklet, opprettet) VALUES ('759560c4-608a-461c-88fd-3b68bf9356d1', 'RV_AY_4', 'Bruker har mottatt dagpenger innenfor 4 uker før skjæringstidspunktet. Kontroller om bruker er dagpengemottaker. Kombinerte ytelser støttes foreløpig ikke av systemet', 'Bruker har mottatt dagpenger innenfor 4 uker før skjæringstidspunktet', 'Sjekk om bruker er dagpengemottaker på sykmeldingstidspunktet. Hvis ja kan ikke saken behandles i dette systemet ennå.', 'false', '2022-11-30 18:25:06.305606') ON CONFLICT(unik_id) DO NOTHING;
            INSERT INTO api_varseldefinisjon (unik_id, kode, tittel, forklaring, handling, avviklet, opprettet) VALUES ('6e4a9a32-b369-4653-9660-ee0681014f3c', 'RV_IT_5', 'Mangler inntekt for første utbetalingsdag i en av infotrygdperiodene', 'Denne sakstypen tas normalt ikke inn i Speil. Det kan ha skjedd en endring fra saken ble behandlet første gang til den nå skal revurderes.', 'Undersøk om saken kan revurderes i Speil og at utbetalingen blir riktig. Hvis saken ikke kan revurderes i Speil, må du annullere og behandle saken i Infotrygd.', 'true', '2022-11-30 18:25:06.305606') ON CONFLICT(unik_id) DO NOTHING;
            INSERT INTO api_varseldefinisjon (unik_id, kode, tittel, forklaring, handling, avviklet, opprettet) VALUES ('754e2023-dae1-4ee9-a3ee-3e5e72450a37', 'RV_VV_1', 'Arbeidsgiver er ikke registrert i Aa-registeret.', 'Arbeidsgiver på sykmelding eller inntektsmelding er ikke registrert i Aa-registeret.', 'Sjekk at bruker er ansatt hos arbeidsgiveren.', 'false', '2022-11-30 18:25:06.305606') ON CONFLICT(unik_id) DO NOTHING;
            INSERT INTO api_varseldefinisjon (unik_id, kode, tittel, forklaring, handling, avviklet, opprettet) VALUES ('c46c81d2-3fb9-4944-9c9d-ed74c3bcad87', 'RV_VV_8', 'Den sykmeldte har skiftet arbeidsgiver, og det er beregnet at den nye arbeidsgiveren mottar refusjon lik forrige. Kontroller at dagsatsen blir riktig.', 'Den sykmeldte har skiftet arbeidsgiver i løpet av sykefraværet.', 'Sjekk at riktig dagsats er lagt til grunn.', 'false', '2022-11-30 18:25:06.305606') ON CONFLICT(unik_id) DO NOTHING;
            INSERT INTO api_varseldefinisjon (unik_id, kode, tittel, forklaring, handling, avviklet, opprettet) VALUES ('48be78c6-29df-47d6-b79d-05c5e457b719', 'RV_VV_9', 'Bruker er fortsatt syk 26 uker etter maksdato', null, null, 'false', '2022-11-30 18:25:06.305606') ON CONFLICT(unik_id) DO NOTHING;
            INSERT INTO api_varseldefinisjon (unik_id, kode, tittel, forklaring, handling, avviklet, opprettet) VALUES ('e0b597c5-14de-4ff7-bddd-b50e5c161d8a', 'RV_SV_1', 'Perioden er avslått på grunn av at inntekt er under krav til minste sykepengegrunnlag', 'Alle dager er avvist på grunn av at sykepengegrunnlaget er under minstekrav', 'Undersøk at sykepengegrunnlaget er korrekt. Hvis det er fastsatt korrekt kan saken godkjennes i speil, da må avslagsbrev sendes i infotrygd.', 'false', '2022-11-30 18:25:06.305606') ON CONFLICT(unik_id) DO NOTHING;
            INSERT INTO api_varseldefinisjon (unik_id, kode, tittel, forklaring, handling, avviklet, opprettet) VALUES ('41b7d5f3-d39d-455b-b64b-8ad9b4128db7', 'RV_OV_1', 'Perioden er avslått på grunn av manglende opptjening', 'Alle dager er avvist på grunn av at personen ikke har jobbet mer enn fire uker før sykmeldingstidspunktet', 'Undersøk at opptjeningen er vurdert riktig. Hvis opptjening ikke er oppfylt kan saken godkjennes i speil og det må sendes avslagsbrev i Infotrygd.', 'false', '2022-11-30 18:25:06.305606') ON CONFLICT(unik_id) DO NOTHING;
            INSERT INTO api_varseldefinisjon (unik_id, kode, tittel, forklaring, handling, avviklet, opprettet) VALUES ('bb554d50-da53-4b02-bd23-36b80ef50b67', 'RV_SØ_9', 'Det er oppgitt annen inntektskilde i søknaden. Vurder inntekt.', 'Den sykmeldte har oppgitt «Annet» som annen inntektskilde i søknaden.', 'Sjekk hva den andre inntektskilden består av og vurder om saken kan behandles i Speil. Hvis saken ikke kan behandles i Speil, må du behandle saken i Infotrygd.', 'true', '2022-11-30 18:25:06.305606') ON CONFLICT(unik_id) DO NOTHING;
