            INSERT INTO api_varseldefinisjon (unik_id, kode, tittel, forklaring, handling, avviklet, opprettet) VALUES ('5a89ec78-ec46-4840-8c3b-1c1c7e7e33e2', 'RV_IT_8', 'Det er en ugyldig utbetalingsperiode i Infotrygd (utbetalingsgrad mangler)', 'Det er lest inn en utbetalingsperiode fra Infotrygd som er mangelfull. Det er fire ulike årsaker til at dette kan skje: Utbetalingsperioden mangler f.o.m. eller t.o.m. dato. F.o.m. er nyere enn t.o.m. Utbetalingsgrad mangler. Utbetalingsgrad er mindre eller lik 0', 'Undersøk om saken kan revurderes i Speil og at utbetalingen blir riktig. Hvis saken ikke kan revurderes i Speil, må du annullere og behandle saken i Infotrygd.', 'false', '2022-11-30 18:25:06.305606') ON CONFLICT(unik_id) DO NOTHING;
            INSERT INTO api_varseldefinisjon (unik_id, kode, tittel, forklaring, handling, avviklet, opprettet) VALUES ('1199d6ae-165c-4efa-89f3-ade4b1034a40', 'RV_IT_9', 'Det er en ugyldig utbetalingsperiode i Infotrygd (utbetalingsgrad er mindre eller lik 0)', 'Det er lest inn en utbetalingsperiode fra Infotrygd som er mangelfull. Det er fire ulike årsaker til at dette kan skje: Utbetalingsperioden mangler f.o.m. eller t.o.m. dato. F.o.m. er nyere enn t.o.m. Utbetalingsgrad mangler. Utbetalingsgrad er mindre eller lik 0', 'Undersøk om saken kan revurderes i Speil og at utbetalingen blir riktig. Hvis saken ikke kan revurderes i Speil, må du annullere og behandle saken i Infotrygd.', 'false', '2022-11-30 18:25:06.305606') ON CONFLICT(unik_id) DO NOTHING;
            INSERT INTO api_varseldefinisjon (unik_id, kode, tittel, forklaring, handling, avviklet, opprettet) VALUES ('c923adcb-f637-420f-8845-35c3da124a7a', 'RV_IT_10', 'Det er en ugyldig utbetalingsperiode i Infotrygd', null, null, 'false', '2022-11-30 18:25:06.305606') ON CONFLICT(unik_id) DO NOTHING;
            INSERT INTO api_varseldefinisjon (unik_id, kode, tittel, forklaring, handling, avviklet, opprettet) VALUES ('142d040f-76fe-4a20-b635-3130245e3013', 'RV_IT_12', 'Organisasjonsnummer for inntektsopplysning fra Infotrygd mangler', 'Denne sakstypen tas normalt ikke inn i Speil. Det kan ha skjedd en endring fra saken ble behandlet første gang til den nå skal revurderes.', 'Undersøk om saken kan revurderes i Speil og at utbetalingen blir riktig. Hvis saken ikke kan revurderes i Speil, må du annullere og behandle saken i Infotrygd.', 'false', '2022-11-30 18:25:06.305606') ON CONFLICT(unik_id) DO NOTHING;
            INSERT INTO api_varseldefinisjon (unik_id, kode, tittel, forklaring, handling, avviklet, opprettet) VALUES ('10552fed-700a-4e54-8c72-dd49f96ec2f4', 'RV_IT_13', 'Støtter ikke overgang fra infotrygd for flere arbeidsgivere', 'Denne sakstypen tas normalt ikke inn i Speil. Det kan ha skjedd en endring fra saken ble behandlet første gang til den nå skal revurderes.', 'Undersøk om saken kan revurderes i Speil og at utbetalingen blir riktig. Hvis saken ikke kan revurderes i Speil, må du annullere og behandle saken i Infotrygd.', 'false', '2022-11-30 18:25:06.305606') ON CONFLICT(unik_id) DO NOTHING;
            INSERT INTO api_varseldefinisjon (unik_id, kode, tittel, forklaring, handling, avviklet, opprettet) VALUES ('2812b489-de3f-481e-87fc-4b0c05dae342', 'RV_IT_14', 'Forlenger en Infotrygdperiode på tvers av arbeidsgivere', null, null, 'false', '2022-11-30 18:25:06.305606') ON CONFLICT(unik_id) DO NOTHING;
            INSERT INTO api_varseldefinisjon (unik_id, kode, tittel, forklaring, handling, avviklet, opprettet) VALUES ('9cdf21b7-2a69-40bd-8a9a-105152ce3943', 'RV_SØ_24', 'Mottatt flere søknade for perioden - den første søknaden som ble mottatt er lagt til grunn. Utbetal kun hvis det blir korrekt', null, null, 'true', '2022-11-30 18:25:06.305606') ON CONFLICT(unik_id) DO NOTHING;
