            INSERT INTO api_varseldefinisjon (unik_id, kode, tittel, forklaring, handling, avviklet, opprettet) VALUES ('8f72836d-5eaa-4306-b2a4-3ffae5faca45', 'RV_SØ_26', 'Søknaden inneholder Feriedager utenfor perioden søknaden gjelder for', 'I søknadsdialogen så blir den sykmeldte spurt om det er ferie i mellomliggende periode. Dette for å finne ut om to perioder hører sammen og om man trenger inntektsmelding.', 'Undersøk om perioden blir riktig beregnet.', 'true', '2022-11-30 18:25:06.305606') ON CONFLICT(unik_id) DO NOTHING;
