            INSERT INTO api_varseldefinisjon (unik_id, kode, tittel, forklaring, handling, avviklet, opprettet) VALUES ('064ace26-8057-48ca-aa40-0ff74fe735c6', 'RV_IM_11', 'Første fraværsdag i inntektsmeldingen er ulik første fraværsdag i sykdomsperioden', null, null, 'true', '2022-11-30 18:25:06.305606') ON CONFLICT(unik_id) DO NOTHING;
            INSERT INTO api_varseldefinisjon (unik_id, kode, tittel, forklaring, handling, avviklet, opprettet) VALUES ('5c4ddc41-811d-4c9f-8a4c-7b972259c89c', 'RV_IM_14', 'Første fraværsdag oppgitt i inntektsmeldingen er ulik den systemet har beregnet. Utbetal kun hvis dagsatsen er korrekt', 'Det er forskjell mellom det arbeidsgiver har oppgitt som første fraværsdag og sykmeldingens fra og med-dato.', 'Sjekk om dagsatsen er riktig, og om saken faktisk er under 25 prosent avvik med sammenligningsgrunnlaget.', 'true', '2022-11-30 18:25:06.305606') ON CONFLICT(unik_id) DO NOTHING;
