            INSERT INTO api_varseldefinisjon (unik_id, kode, tittel, forklaring, handling, avviklet, opprettet) VALUES ('46d38c2b-708f-499a-a929-14dd712e4561', 'RV_SØ_23', 'Korrigert søknad er mottatt med nye opplysninger - kontroller dagene i sykmeldingsperioden', 'Det har kommet en korrigert søknad som er lagt til grunn', 'Kontroller at dagene i sykmeldingsperioden blir riktig', 'true', '2022-11-30 18:25:06.305606') ON CONFLICT(unik_id) DO NOTHING;
