            INSERT INTO api_varseldefinisjon (unik_id, kode, tittel, forklaring, handling, avviklet, opprettet) VALUES ('2c47041e-57c5-43e4-9c3c-17c51e3652d5', 'RV_IT_29', 'Perioden er lagt inn i Infotrygd - men mangler inntektsopplysninger. Fjern perioden fra SP UB hvis du utbetaler via speil.', null, null, 'true', '2022-11-30 18:25:06.305606') ON CONFLICT(unik_id) DO NOTHING;
            INSERT INTO api_varseldefinisjon (unik_id, kode, tittel, forklaring, handling, avviklet, opprettet) VALUES ('b6f0eaa5-9f93-46ac-a5a0-c72cff8d1659', 'RV_IT_30', 'Perioden er lagt inn i Infotrygd, men ikke utbetalt. Fjern fra Infotrygd hvis det utbetales via speil.', 'Det ligger registrert en søknad om sykepenger på SP UB.', 'Dette varselet betyr ikke at perioden må behandles i Infotrygd. Fjern perioden fra SP UB når du utbetaler via speil. Hvis inntekten er registert så kan den slettes på SP-VT. Hvis det er en forutgående periode i Infotrygd som enda ikke er behandlet, trenger du ikke å avvise perioden hvis det er flere sykepengedager igjen er enn det som ligger til behandling i Infotrygd.', 'true', '2022-11-30 18:25:06.305606') ON CONFLICT(unik_id) DO NOTHING;
            INSERT INTO api_varseldefinisjon (unik_id, kode, tittel, forklaring, handling, avviklet, opprettet) VALUES ('03787642-c7d3-4a0b-a88f-9ce1b3cbf4ce', 'RV_IT_31', 'Perioden forlenger en behandling i Infotrygd, og har historikk fra ny løsning: Undersøk at antall dager igjen er beregnet riktig.', null, null, 'true', '2022-11-30 18:25:06.305606') ON CONFLICT(unik_id) DO NOTHING;
            INSERT INTO api_varseldefinisjon (unik_id, kode, tittel, forklaring, handling, avviklet, opprettet) VALUES ('eb95db50-b7df-456a-aadd-8803afab9ffa', 'RV_IT_32', 'Perioden forlenger en behandling i ny løsning, og har historikk i Infotrygd også: Undersøk at antall dager igjen er beregnet riktig.', null, null, 'true', '2022-11-30 18:25:06.305606') ON CONFLICT(unik_id) DO NOTHING;
            INSERT INTO api_varseldefinisjon (unik_id, kode, tittel, forklaring, handling, avviklet, opprettet) VALUES ('8f0d7a69-a4f9-477a-8c20-ba056fc51495', 'RV_IT_33', 'Skjæringstidspunktet har endret seg som følge av historikk fra Infotrygd', null, null, 'false', '2022-11-30 18:25:06.305606') ON CONFLICT(unik_id) DO NOTHING;
            INSERT INTO api_varseldefinisjon (unik_id, kode, tittel, forklaring, handling, avviklet, opprettet) VALUES ('c6a94ae5-2689-431e-8103-05142b3b4778', 'RV_VV_10', 'Fant ikke vilkårsgrunnlag. Kan ikke vilkårsprøve på nytt etter ny informasjon fra saksbehandler.', null, null, 'false', '2022-11-30 18:25:06.305606') ON CONFLICT(unik_id) DO NOTHING;
            INSERT INTO api_varseldefinisjon (unik_id, kode, tittel, forklaring, handling, avviklet, opprettet) VALUES ('62cc4499-793c-46e0-a0da-2d84af5accb0', 'RV_VV_11', 'Vilkårsgrunnlaget ligger i infotrygd. Det er ikke støttet i revurdering eller overstyring.', null, null, 'false', '2022-11-30 18:25:06.305606') ON CONFLICT(unik_id) DO NOTHING;
            INSERT INTO api_varseldefinisjon (unik_id, kode, tittel, forklaring, handling, avviklet, opprettet) VALUES ('4c130fb5-8d02-4c8a-826e-ed989ba58c1e', 'RV_VV_12', 'Kan ikke overstyre inntekt uten at det foreligger et vilkårsgrunnlag', null, null, 'false', '2022-11-30 18:25:06.305606') ON CONFLICT(unik_id) DO NOTHING;
            INSERT INTO api_varseldefinisjon (unik_id, kode, tittel, forklaring, handling, avviklet, opprettet) VALUES ('57828f59-d560-4bdf-a383-d6a1bd352c86', 'RV_VV_13', '26 uker siden forrige utbetaling av sykepenger, vurder om vilkårene for sykepenger er oppfylt', 'Bruker har tidligere fått utbetalt sykepenger til maksdato. Det er nå mer enn 26 uker siden siste utbetaling av sykepenger(§ 8-12).', 'Saken må behandles som en førstegangssak og alle vilkårene for å få sykepenger må vurderes.', 'true', '2022-11-30 18:25:06.305606') ON CONFLICT(unik_id) DO NOTHING;
            INSERT INTO api_varseldefinisjon (unik_id, kode, tittel, forklaring, handling, avviklet, opprettet) VALUES ('ddc7131a-bb42-4e65-9c35-8bea72e20a9e', 'RV_VV_14', 'Denne personen har en utbetaling for samme periode for en annen arbeidsgiver. Kontroller at beregningene for begge arbeidsgiverne er korrekte.', 'Da vi beregnet den forrige utbetalingen visste vi ikke at personen var syk for denne arbeidsgiveren.', 'Det kan hende at begge beregningene er riktig, men dette må kontrolleres. Hvis det er feil må perioder som er ferdig behandlet annulleres og alt må behandles i Infotrygd.', 'true', '2022-11-30 18:25:06.305606') ON CONFLICT(unik_id) DO NOTHING;
            INSERT INTO api_varseldefinisjon (unik_id, kode, tittel, forklaring, handling, avviklet, opprettet) VALUES ('942e48e7-3393-4620-9497-ce47c5cbebe5', 'RV_VV_15', 'Maks antall sykepengedager er nådd i perioden', null, null, 'true', '2022-11-30 18:25:06.305606') ON CONFLICT(unik_id) DO NOTHING;
            INSERT INTO api_varseldefinisjon (unik_id, kode, tittel, forklaring, handling, avviklet, opprettet) VALUES ('bc51ab13-8dac-4858-be13-c62aa3acc34a', 'RV_VV_16', 'Søknaden inneholder egenmeldingsdager som ikke er oppgitt i inntektsmeldingen. Vurder om arbeidsgiverperioden beregnes riktig', 'Egenmeldingsdager er ikke oppgitt i inntektsmeldingen, men i søknaden', 'Sjekk om arbeidsgiver har oppgitt riktig arbeidsgiverperioden.', 'true', '2022-11-30 18:25:06.305606') ON CONFLICT(unik_id) DO NOTHING;
            INSERT INTO api_varseldefinisjon (unik_id, kode, tittel, forklaring, handling, avviklet, opprettet) VALUES ('d809988d-6b0e-40ea-8e58-054c1acf3fdd', 'RV_IV_4', 'Finnes inntekter fra flere virksomheter siste tre måneder', null, null, 'true', '2022-11-30 18:25:06.305606') ON CONFLICT(unik_id) DO NOTHING;
            INSERT INTO api_varseldefinisjon (unik_id, kode, tittel, forklaring, handling, avviklet, opprettet) VALUES ('66a9fe5f-4bb4-44d7-a04e-b74ad028f81f', 'RV_IV_5', 'Har inntekt på flere arbeidsgivere med forskjellig fom dato', null, null, 'true', '2022-11-30 18:25:06.305606') ON CONFLICT(unik_id) DO NOTHING;
            INSERT INTO api_varseldefinisjon (unik_id, kode, tittel, forklaring, handling, avviklet, opprettet) VALUES ('ae709e29-b6d8-49b2-af9a-39fef995dce2', 'RV_IV_6', 'Inntekter fra mer enn én arbeidsgiver i A-ordningen siste tre måneder. Kontroller om brukeren har flere arbeidsforhold på sykmeldingstidspunktet. Flere arbeidsforhold støttes ikke av systemet.', null, null, 'true', '2022-11-30 18:25:06.305606') ON CONFLICT(unik_id) DO NOTHING;
            INSERT INTO api_varseldefinisjon (unik_id, kode, tittel, forklaring, handling, avviklet, opprettet) VALUES ('15a7c047-8858-4203-b786-8118bb78a3b6', 'RV_SV_3', 'Mangler inntekt for sykepengegrunnlag som følge av at skjæringstidspunktet har endret seg', null, null, 'false', '2022-11-30 18:25:06.305606') ON CONFLICT(unik_id) DO NOTHING;
            INSERT INTO api_varseldefinisjon (unik_id, kode, tittel, forklaring, handling, avviklet, opprettet) VALUES ('4fb9c93a-229c-47a1-996c-a557d060b228', 'RV_SV_4', 'Brukeren har flere inntekter de siste tre måneder. Kontroller om brukeren har flere arbeidsforhold eller andre ytelser på sykmeldingstidspunktet som påvirker utbetalingen.', 'Det finnes inntekter fra mer enn én arbeidsgiver i A-ordningen i de siste tre månedene', 'Sjekk om den sykmeldte har flere aktive inntektskilder på sykmeldingstidspunktet. Speil håndterer ikke kombinasjonen arbeidstaker og frilanser. I slike tilfeller må saken behandles i Infotrygd.', 'true', '2022-11-30 18:25:06.305606') ON CONFLICT(unik_id) DO NOTHING;
            INSERT INTO api_varseldefinisjon (unik_id, kode, tittel, forklaring, handling, avviklet, opprettet) VALUES ('fc7172d9-d707-4e60-a87d-a88563fd37e6', 'RV_AY_10', 'Behandling av Ytelser feilet, årsak ukjent', null, null, 'false', '2022-11-30 18:25:06.305606') ON CONFLICT(unik_id) DO NOTHING;
            INSERT INTO api_varseldefinisjon (unik_id, kode, tittel, forklaring, handling, avviklet, opprettet) VALUES ('e991fb7f-d59c-4f2c-9283-8cc5523ed693', 'RV_IT_16', 'Støtter ikke saker med vilkårsgrunnlag i Infotrygd', null, null, 'false', '2022-11-30 18:25:06.305606') ON CONFLICT(unik_id) DO NOTHING;
            INSERT INTO api_varseldefinisjon (unik_id, kode, tittel, forklaring, handling, avviklet, opprettet) VALUES ('29a50966-db2b-46ac-8730-243e3e05ccce', 'RV_IT_17', 'Forespurt overstyring av inntekt hvor skjæringstidspunktet ligger i infotrygd', null, null, 'false', '2022-11-30 18:25:06.305606') ON CONFLICT(unik_id) DO NOTHING;
            INSERT INTO api_varseldefinisjon (unik_id, kode, tittel, forklaring, handling, avviklet, opprettet) VALUES ('bf216faf-d4c8-4816-a5fa-248cbfe6345b', 'RV_IT_18', 'Avslutter perioden fordi tilstøtende, eller nyere periode, gikk til Infotrygd', null, null, 'true', '2022-11-30 18:25:06.305606') ON CONFLICT(unik_id) DO NOTHING;
            INSERT INTO api_varseldefinisjon (unik_id, kode, tittel, forklaring, handling, avviklet, opprettet) VALUES ('71cec710-459c-485b-a1de-af3a2cbbf9d3', 'RV_IT_19', 'Dagsatsen har endret seg minst én gang i en historisk, sammenhengende periode i Infotrygd.', null, null, 'true', '2022-11-30 18:25:06.305606') ON CONFLICT(unik_id) DO NOTHING;
