            INSERT INTO api_varseldefinisjon (unik_id, kode, tittel, forklaring, handling, avviklet, opprettet) VALUES ('852376cd-925e-49d1-af56-8f3edc744b5f', 'RV_AN_4', 'Personen har blitt tilbakestilt og kan derfor ha avvik i historikken fra infotrygd.', null, null, 'true', '1970-01-01 00:00:00.000000') ON CONFLICT(unik_id) DO NOTHING;
            INSERT INTO api_varseldefinisjon (unik_id, kode, tittel, forklaring, handling, avviklet, opprettet) VALUES ('473202cb-5079-4ce2-9f8a-dc04e4b3c99e', 'RV_MV_1', 'Vi vet ikke om bruker er medlem av Folketrygden', null, null, 'false', '1970-01-01 00:00:00.000000') ON CONFLICT(unik_id) DO NOTHING;
            INSERT INTO api_varseldefinisjon (unik_id, kode, tittel, forklaring, handling, avviklet, opprettet) VALUES ('bcd1fb4f-2871-4f2b-97b0-c4cb10d13313', 'RV_SØ_22', 'Søknaden inneholder en Papirsykmeldingsperiode', 'Sjekk om papirsykmeldingen er med i arbeidsgiverperioden hvis det er en førstegangssak. Sjekk om papirsykmeldingen medfører endring i grad hvis det er en forlengelse.', 'Utbetal kun hvis arbeidsgiverperioden er korrekt. Korriger eventuelt grad.', 'false', '2022-11-30 18:25:06.305606') ON CONFLICT(unik_id) DO NOTHING;
            INSERT INTO api_varseldefinisjon (unik_id, kode, tittel, forklaring, handling, avviklet, opprettet) VALUES ('e9678c4f-b897-4c9f-8679-c3a219751054', 'RV_IT_6', 'Det er en ugyldig utbetalingsperiode i Infotrygd (mangler fom- eller tomdato)', 'Det er lest inn en utbetalingsperiode fra Infotrygd som er mangelfull. Det er fire ulike årsaker til at dette kan skje: Utbetalingsperioden mangler f.o.m. eller t.o.m. dato. F.o.m. er nyere enn t.o.m. Utbetalingsgrad mangler. Utbetalingsgrad er mindre eller lik 0', 'Undersøk om saken kan revurderes i Speil og at utbetalingen blir riktig. Hvis saken ikke kan revurderes i Speil, må du annullere og behandle saken i Infotrygd.', 'false', '2022-11-30 18:25:06.305606') ON CONFLICT(unik_id) DO NOTHING;
            INSERT INTO api_varseldefinisjon (unik_id, kode, tittel, forklaring, handling, avviklet, opprettet) VALUES ('ed7d7159-1709-47a1-bc50-ff72ed6aface', 'RV_IT_15', 'Personen er ikke registrert som normal arbeidstaker i Infotrygd', 'Denne sakstypen tas normalt ikke inn i Speil. Det kan ha skjedd en endring fra saken ble behandlet første gang til den nå skal revurderes.', 'Undersøk om saken kan revurderes i Speil og at utbetalingen blir riktig. Hvis saken ikke kan revurderes i Speil, må du annullere og behandle saken i Infotrygd.', 'false', '2022-11-30 18:25:06.305606') ON CONFLICT(unik_id) DO NOTHING;
            INSERT INTO api_varseldefinisjon (unik_id, kode, tittel, forklaring, handling, avviklet, opprettet) VALUES ('f2a6017c-1482-4e9d-910a-48a02039dc4d', 'RV_SØ_1', 'Søknaden inneholder permittering. Vurder om permittering har konsekvens for rett til sykepenger', 'Bruker har oppgitt permittering på søknad om sykepenger', 'Kontrollér at permitteringen ikke påvirker sykepengerettighetene', 'false', '2022-11-30 18:25:06.305606') ON CONFLICT(unik_id) DO NOTHING;
            INSERT INTO api_varseldefinisjon (unik_id, kode, tittel, forklaring, handling, avviklet, opprettet) VALUES ('02b938ca-5c42-4d14-90a0-48bed6b85c3a', 'RV_SØ_2', 'Minst én dag er avslått på grunn av foreldelse. Vurder å sende vedtaksbrev fra Infotrygd', 'Søknaden har kommet inn mer enn 3 måneder før dagen/dagene.', 'Hvis det ikke finnes noe unntak fra foreldelsesfristen skal du godkjenne i Speil og sende vedtaksbrev fra Infotrygd. Hvis forslaget er feil må du avvise saken i Speil og behandle i Infotrygd. Dersom dagen/dagene som er avslått er innenfor arbeidsgiverperioden trenger du ikke å sende avslag fra Infotrygd.', 'false', '2022-11-30 18:25:06.305606') ON CONFLICT(unik_id) DO NOTHING;
            INSERT INTO api_varseldefinisjon (unik_id, kode, tittel, forklaring, handling, avviklet, opprettet) VALUES ('6f3889d8-a64f-4c05-bde9-da99a7588cc1', 'RV_IM_4', 'Det er mottatt flere inntektsmeldinger på samme skjæringstidspunkt. Undersøk at arbeidsgiverperioden, sykepengegrunnlaget og refusjonsopplysningene er riktige.', 'Det har kommet inn flere inntektsmeldinger. Speil håndterer endringer i refusjon, men ikke tilfeller der inntekt eller arbeidsgiverperiode er endret. ', 'Du må undersøke om det er oppgitt endringer i inntekt, refusjon eller arbeidsgiverperiode som skal legges til grunn i saken og/ eller om forslaget til vedtak er riktig. Hvis det må gjøres endringer må du undersøke om saken kan revurderes i Speil, eller om saken må tas i Infotrygd.', 'false', '2022-12-15 10:02:39.579636') ON CONFLICT(unik_id) DO NOTHING;
            INSERT INTO api_varseldefinisjon (unik_id, kode, tittel, forklaring, handling, avviklet, opprettet) VALUES ('daf26716-7ece-4da7-9513-6e38b187651f', 'RV_IT_3', 'Utbetaling i Infotrygd overlapper med vedtaksperioden', 'Denne sakstypen tas normalt ikke inn i Speil. Det kan ha skjedd en endring fra saken ble behandlet første gang til den nå skal revurderes.', 'Undersøk om saken kan revurderes i Speil og at utbetalingen blir riktig. Hvis saken ikke kan revurderes i Speil, må du annullere og behandle saken i Infotrygd.', 'false', '2022-11-30 18:25:06.305606') ON CONFLICT(unik_id) DO NOTHING;
            INSERT INTO api_varseldefinisjon (unik_id, kode, tittel, forklaring, handling, avviklet, opprettet) VALUES ('a3d887c2-6ea6-4ee5-8249-1705e3ea3958', 'RV_AY_5', 'Det er utbetalt foreldrepenger i samme periode.', 'Det er utbetalt foreldrepenger i Infotrygd etter at perioden ble godkjent i Speil.', 'Undersøk hvilken ytelse som er riktig. Hvis utbetalingene i Speil må avslås på grunn av andre ytelser må du annullere og behandle i Infotrygd.', 'false', '2022-11-30 18:25:06.305606') ON CONFLICT(unik_id) DO NOTHING;
            INSERT INTO api_varseldefinisjon (unik_id, kode, tittel, forklaring, handling, avviklet, opprettet) VALUES ('172d6a10-eee3-41d0-be1b-8354e0e8b297', 'RV_AY_9', 'Det er institusjonsopphold i perioden. Vurder retten til sykepenger.', 'Vi henter inn opplysninger om institusjonsopphold. Det har kommet informasjon om at den sykmeldte oppholdt seg i institusjon (sykehus eller fengsel) i perioden.', 'Undersøk om institusjonsoppholdet er forenlig med å motta sykepenger. Dersom en periode skal avslås på grunn av institusjonsopphold må saken annulleres og behandles i Infotrygd.', 'false', '2022-11-30 18:25:06.305606') ON CONFLICT(unik_id) DO NOTHING;
            INSERT INTO api_varseldefinisjon (unik_id, kode, tittel, forklaring, handling, avviklet, opprettet) VALUES ('26d44436-0993-479c-b8fb-f5d51a66f5d6', 'RV_SØ_20', 'Søknad overlapper med, eller er før, en forkastet vedtaksperiode', null, null, 'false', '2022-11-30 18:25:06.305606') ON CONFLICT(unik_id) DO NOTHING;
            INSERT INTO api_varseldefinisjon (unik_id, kode, tittel, forklaring, handling, avviklet, opprettet) VALUES ('c07a5594-13b6-4c6f-9737-8b70d5ab17e6', 'RV_UT_21', 'Utbetalingen opphører tidligere utbetaling.', 'På grunn av endring i for eksempel arbeidsgiverperiode eller andre årsaker beregner vi én sammenhengende utbetalingsak hvor det tidligere har vært flere.', 'Kontakt noen i Klynge Bømlo, eksempelvis produktleder eller teknisk leder. Sakene må behandles i samråd med noen i utviklingsteamet.', 'false', '2023-03-10 07:20:49.927941') ON CONFLICT(unik_id) DO NOTHING;
            INSERT INTO api_varseldefinisjon (unik_id, kode, tittel, forklaring, handling, avviklet, opprettet) VALUES ('ad812961-b174-4deb-93cc-db1e376e6bb6', 'RV_UT_3', 'Feil ved utbetalingstidslinjebygging', null, null, 'false', '2022-11-30 18:25:06.305606') ON CONFLICT(unik_id) DO NOTHING;
            INSERT INTO api_varseldefinisjon (unik_id, kode, tittel, forklaring, handling, avviklet, opprettet) VALUES ('4ff11587-4d88-4065-9bf4-1917c9f05e02', 'RV_UT_4', 'Finner ingen utbetaling å annullere', null, null, 'false', '2022-11-30 18:25:06.305606') ON CONFLICT(unik_id) DO NOTHING;
            INSERT INTO api_varseldefinisjon (unik_id, kode, tittel, forklaring, handling, avviklet, opprettet) VALUES ('da30d386-12e3-4864-afe1-a67b75501804', 'RV_IT_27', 'Opplysninger fra Infotrygd har endret seg etter at vedtaket ble fattet. Undersøk om det er overlapp med periode fra Infotrygd.', 'Vi fikk informasjon fra Infotrygd som er annerledes enn da vedtaket ble fattet.', 'Hvis en periode overlapper med Infotrygd så må utbetalingen i Infotrygd returføres. Undersøk også om opplysningene fra Infotrygd er endret, f.eks. i vedtaksinformasjonen. Om den nye informasjonen i Infotrygd er korrekt og fører til at saken ikke støttes i Speil, må den annulleres.', 'true', '2022-11-30 18:25:06.305606') ON CONFLICT(unik_id) DO NOTHING;
            INSERT INTO api_varseldefinisjon (unik_id, kode, tittel, forklaring, handling, avviklet, opprettet) VALUES ('f6dc851d-ec03-4995-b792-ff238875b02c', 'RV_SI_3', 'Det er simulert et negativt beløp.', 'Vedtaksløsningen foreslår å omgjøre tidligere utbetaling av sykepenger, slik at hele eller deler av simuleringen gir et negativt beløp.', 'Undersøk om simuleringen gir et ønsket og riktig resultat og korriger hvis simuleringen er feil. Hvis simuleringen er riktig, se rutine for revurdering, feilutbetaling og tilbakekreving.', 'false', '2022-11-30 18:25:06.305606') ON CONFLICT(unik_id) DO NOTHING;
            INSERT INTO api_varseldefinisjon (unik_id, kode, tittel, forklaring, handling, avviklet, opprettet) VALUES ('b5637a1d-661c-4f06-8a6a-15c4bb44f0ba', 'RV_MV_3', 'Arbeid utenfor Norge oppgitt i søknaden', 'Medlemskapet er uavklart', 'Kontroller medlemskapet', 'false', '2023-03-17 08:38:41.401333') ON CONFLICT(unik_id) DO NOTHING;
            INSERT INTO api_varseldefinisjon (unik_id, kode, tittel, forklaring, handling, avviklet, opprettet) VALUES ('69e347ed-4b39-4007-8de2-9d090417af6f', 'RV_UT_21', 'Utbetalingen opphører tidligere utbetaling.', 'På grunn av endring i for eksempel arbeidsgiverperiode eller andre årsaker beregner vi én sammenhengende utbetalingsak hvor det tidligere har vært flere.', 'Kontakt en coach/supersaksbehandler, som vil ta kontakt med utviklingsteamet. ', 'false', '2023-03-17 08:59:09.542032') ON CONFLICT(unik_id) DO NOTHING;
            INSERT INTO api_varseldefinisjon (unik_id, kode, tittel, forklaring, handling, avviklet, opprettet) VALUES ('c2158bad-3b0c-49e3-8961-755bc082f310', 'RV_MV_3', 'Arbeid utenfor Norge oppgitt i søknaden', 'Det er oppgitt arbeid i utlandet i løpet av de siste 12 måneder', 'Hvis bokommune er 0393 eller 2101 skal saken avvises og behandles av NAV Utland. I alle andre tilfeller, vurder om personen er medlem i folketrygden på sykmeldingstidspunktet. Det er særlige EØS-regler for blant annet opptjening og beregning.  Se særlig rundskriv R-45 kapittel 8', 'false', '2023-03-17 10:33:04.964930') ON CONFLICT(unik_id) DO NOTHING;
            INSERT INTO api_varseldefinisjon (unik_id, kode, tittel, forklaring, handling, avviklet, opprettet) VALUES ('1dfc594d-3e32-4021-aadf-19018252053f', 'RV_OV_1', 'Perioden er avslått på grunn av manglende opptjening', 'Alle dager er avvist på grunn av at personen ikke har jobbet mer enn fire uker før sykmeldingstidspunktet', 'Undersøk at opptjeningen er vurdert riktig etter § 8-2 og om § 8-47 får anvendelse. Hvis vilkårene ikke er oppfylt kan saken godkjennes i Speil og det må sendes avslagsbrev i Infotrygd.  Hvis vilkårene er oppfylt må saken avvises i Speil og behandles i Infotrygd.', 'false', '2023-03-17 10:40:03.567004') ON CONFLICT(unik_id) DO NOTHING;
            INSERT INTO api_varseldefinisjon (unik_id, kode, tittel, forklaring, handling, avviklet, opprettet) VALUES ('c4bca294-8a40-4e3d-89a5-167c39dfdef4', 'RV_VV_2', 'Flere arbeidsgivere, ulikt starttidspunkt for sykefraværet eller ikke fravær fra alle arbeidsforhold', 'Det tidligste sykefraværet bestemmer skjæringstidspunktet. Dette gjelder: Inntekt på inntektsmeldingen som kommer fra arbeidsgivere med senere starttidspunkt kan gjelde feil periode og/eller inntekten som er foreslått for minst et av arbeidsforholdene er innhentet fra a-ordningen og er gjennomsnittet av rapportert inntekt de tre siste månedene før tidspunktet for arbeidsuførhet (§8-28 3. ledd bokstav a).', 'Du må fastsette et sykepengegrunnlag basert på inntekt fra alle arbeidsforholdene. Du må vurdere om de foreslåtte arbeidsforholdene er reelle og skal tas med i beregningen.  Hvis det er kommet inntektsmelding fra arbeidsgiver med senere starttidspunkt, må det sjekkes om inntekten for dette arbeidsforholdet er riktig beregnet (§8-28). Hvis det ikke er kommet inntektsmelding fra denne arbeidsgiveren, må den foreslåtte inntekten vurderes. Du må vurdere om den innhentede inntekten er riktig. Sjekk om det er et nytt arbeidsforhold eller varig lønnsendring i beregningsperioden. Sjekk om det variasjoner i inntekten som kan bety at det er lovlig fravær uten lønn i beregningsperioden. Vurderes etter §8-28.', 'false', '2022-11-30 18:25:06.305606') ON CONFLICT(unik_id) DO NOTHING;
            INSERT INTO api_varseldefinisjon (unik_id, kode, tittel, forklaring, handling, avviklet, opprettet) VALUES ('bef777cd-810a-40b6-872a-d43f6536b6ff', 'RV_AY_8', 'Det er utbetalt opplæringspenger i samme periode.', 'Det er utbetalt opplæringspenger i Infotrygd etter at perioden ble godkjent i Speil.', 'Undersøk hvilken ytelse som er riktig. Hvis utbetalingene i Speil må avslås på grunn av andre ytelser må du annullere og behandle i Infotrygd.', 'false', '2022-11-30 18:25:06.305606') ON CONFLICT(unik_id) DO NOTHING;
            INSERT INTO api_varseldefinisjon (unik_id, kode, tittel, forklaring, handling, avviklet, opprettet) VALUES ('b30e6fd3-b2cc-4f9c-80f0-de1979d84671', 'RV_SI_1', 'Feil under simulering', null, null, 'false', '2022-11-30 18:25:06.305606') ON CONFLICT(unik_id) DO NOTHING;
            INSERT INTO api_varseldefinisjon (unik_id, kode, tittel, forklaring, handling, avviklet, opprettet) VALUES ('28431271-300c-4166-abd6-c71466b3ec93', 'RV_RV_2', 'Forkaster avvist revurdering ettersom vedtaksperioden ikke har tidligere utbetalte utbetalinger.', null, null, 'false', '2022-11-30 18:25:06.305606') ON CONFLICT(unik_id) DO NOTHING;
            INSERT INTO api_varseldefinisjon (unik_id, kode, tittel, forklaring, handling, avviklet, opprettet) VALUES ('acdcdc44-d8a2-451c-8f5f-acc5391820bb', 'RV_RV_3', 'Forespurt revurdering av inntekt hvor personen har flere arbeidsgivere (inkl. ghosts)', null, null, 'true', '2022-11-30 18:25:06.305606') ON CONFLICT(unik_id) DO NOTHING;
            INSERT INTO api_varseldefinisjon (unik_id, kode, tittel, forklaring, handling, avviklet, opprettet) VALUES ('9204b6fd-4689-4549-8525-995abe57b05b', 'RV_IM_23', 'Arbeidsgiver har oppgitt hullete arbeidsgiverperiode og begrunnelse for redusert utbetaling i arbeidsgiverperiode', 'Dette støttes foreløpig ikke.', 'Behandles i Infotrygd', 'false', '2023-04-26 10:09:06.655155') ON CONFLICT(unik_id) DO NOTHING;
            INSERT INTO api_varseldefinisjon (unik_id, kode, tittel, forklaring, handling, avviklet, opprettet) VALUES ('4de85c57-5ef0-47c0-8073-970c32eea6a9', 'RV_SI_2', 'Simulering av revurdert utbetaling feilet. Utbetalingen må annulleres', null, null, 'false', '2022-11-30 18:25:06.305606') ON CONFLICT(unik_id) DO NOTHING;
            INSERT INTO api_varseldefinisjon (unik_id, kode, tittel, forklaring, handling, avviklet, opprettet) VALUES ('3a07dff5-83f6-4424-a002-a2888d080287', 'RV_UT_1', 'Utbetaling av revurdert periode ble avvist av saksbehandler. Utbetalingen må annulleres', null, null, 'false', '2022-11-30 18:25:06.305606') ON CONFLICT(unik_id) DO NOTHING;
            INSERT INTO api_varseldefinisjon (unik_id, kode, tittel, forklaring, handling, avviklet, opprettet) VALUES ('b65542ae-839e-4e40-bafd-7145f41c64c9', 'RV_UT_2', 'Utbetalingen ble gjennomført, men med advarsel', null, null, 'false', '2022-11-30 18:25:06.305606') ON CONFLICT(unik_id) DO NOTHING;
            INSERT INTO api_varseldefinisjon (unik_id, kode, tittel, forklaring, handling, avviklet, opprettet) VALUES ('8eca1359-0048-4a3b-a44a-9380035c100d', 'RV_RV_4', 'Revurdering er igangsatt og må fullføres', null, null, 'true', '2022-11-30 18:25:06.305606') ON CONFLICT(unik_id) DO NOTHING;
            INSERT INTO api_varseldefinisjon (unik_id, kode, tittel, forklaring, handling, avviklet, opprettet) VALUES ('8bb6ad93-515b-4d21-a970-ecfc1f2aaa5d', 'RV_RV_5', 'Validering av ytelser ved revurdering feilet. Utbetalingen må annulleres', null, null, 'true', '2022-11-30 18:25:06.305606') ON CONFLICT(unik_id) DO NOTHING;
            INSERT INTO api_varseldefinisjon (unik_id, kode, tittel, forklaring, handling, avviklet, opprettet) VALUES ('022bf399-a36d-486e-b26b-33829305ea63', 'RV_AN_5', 'Personen har blitt behandlet på en tidligere ident', null, null, 'false', '2023-03-02 14:31:33.906871') ON CONFLICT(unik_id) DO NOTHING;
            INSERT INTO api_varseldefinisjon (unik_id, kode, tittel, forklaring, handling, avviklet, opprettet) VALUES ('f402dfbc-6063-4ec6-a786-853f9b7d5461', 'RV_IM_22', 'Det er mottatt flere inntektsmeldinger på kort tid for samme arbeidsgiver', 'Det har kommet inn flere inntektsmeldinger på kort tid', 'Du må undersøke om det er oppgitt endringer i inntekt, refusjon eller arbeidsgiverperiode som skal legges til grunn i saken og/ eller om forslaget til vedtak er riktig. Hvis det må gjøres endringer må du undersøke om saken kan revurderes i Speil, eller om saken må tas i Infotrygd.', 'false', '2023-03-02 14:31:34.018852') ON CONFLICT(unik_id) DO NOTHING;
            INSERT INTO api_varseldefinisjon (unik_id, kode, tittel, forklaring, handling, avviklet, opprettet) VALUES ('90970fbc-8784-4481-9e23-e685e9273ba1', 'RV_IM_4', 'Det er mottatt flere inntektsmeldinger på samme skjæringstidspunkt. Undersøk at arbeidsgiverperioden, sykepengegrunnlaget og refusjonsopplysningene er riktige.', 'Det har kommet inn flere inntektsmeldinger. Speil håndterer endringer i refusjon og inntekt, men ikke tilfeller der arbeidsgiverperiode er endret.', 'Du må undersøke om det er oppgitt endringer i inntekt, refusjon eller arbeidsgiverperiode som skal legges til grunn i saken og/ eller om forslaget til vedtak er riktig. Hvis det må gjøres endringer må du undersøke om saken kan revurderes i Speil, eller om saken må tas i Infotrygd.', 'false', '2023-03-09 13:34:47.057801') ON CONFLICT(unik_id) DO NOTHING;
            INSERT INTO api_varseldefinisjon (unik_id, kode, tittel, forklaring, handling, avviklet, opprettet) VALUES ('c38255c3-eb65-499a-99d3-cdda58983a6a', 'RV_SØ_2', 'Minst én dag er avslått på grunn av at søknaden er fremsatt for sent. Vurder å sende vedtaksbrev fra Infotrygd.', 'Søknaden har kommet inn etter at fristen for å fremsette krav i § 22-13 tredje ledd er gått ut for deler av/hele perioden det søkes om sykepenger for.', 'Vurder om søknaden er fremsatt for sent, og om den sykmeldte fyller vilkårene i reglene i § 22-13 syvende ledd.  Hvis ikke skal du godkjenne i Speil og sende vedtaksbrev fra Infotrygd. Hvis forslaget er feil må du avvise saken i Speil og behandle i Infotrygd. Dersom dagen/dagene som er avslått er innenfor arbeidsgiverperioden trenger du ikke å sende avslag fra Infotrygd.', 'false', '2023-03-20 10:58:20.269207') ON CONFLICT(unik_id) DO NOTHING;
            INSERT INTO api_varseldefinisjon (unik_id, kode, tittel, forklaring, handling, avviklet, opprettet) VALUES ('6f77d390-ade2-4b48-a946-7f26d648f9d3', 'RV_YS_1', 'Yrkesskade oppgitt i søknaden', 'Bruker har oppgitt at det er yrkesskade eller yrkessykdom som er årsaken til sykmelding ', 'Undersøk om om det er relevant og godkjent yrkesskade for saken. Hvis det er tilfellet må saken behandles i Infotrygd', 'false', '2023-03-20 11:03:26.643783') ON CONFLICT(unik_id) DO NOTHING;
            INSERT INTO api_varseldefinisjon (unik_id, kode, tittel, forklaring, handling, avviklet, opprettet) VALUES ('d26b8d84-8be7-4f8f-bb80-6f5bef00faca', 'RV_YS_1', 'Yrkesskade eller yrkessykdom oppgitt i søknaden', 'Det er et treff i yrkesskaderegisteret og/eller oppgitt yrkesskade/yrkessykdom i sykmeldingen, og i tillegg har den sykmeldte svart at det er yrkesskade eller yrkessykdom som er årsaken til sykmelding.', e'Den sykmeldte kan ha rett til sykepenger etter særbestemmelsene i § 8-55. Denne vurderingen foretas av spesialisert enhet.
            INSERT INTO api_varseldefinisjon (unik_id, kode, tittel, forklaring, handling, avviklet, opprettet) VALUES ('56edb38f-f056-443e-a0ac-2bb5ca21af2f', 'RV_YS_1', 'Yrkesskade eller yrkessykdom oppgitt i søknaden', 'Det er et treff i yrkesskaderegisteret og/eller oppgitt yrkesskade/yrkessykdom i sykmeldingen, og i tillegg har den sykmeldte svart at det er yrkesskade eller yrkessykdom som er årsaken til sykmelding.', e'Den sykmeldte kan ha rett til sykepenger etter særbestemmelsene i § 8-55. Denne vurderingen foretas av spesialisert enhet.
            INSERT INTO api_varseldefinisjon (unik_id, kode, tittel, forklaring, handling, avviklet, opprettet) VALUES ('e605161e-b78b-49f8-97d9-8b4d35616855', 'RV_IM_3', 'Inntektsmeldingen og vedtaksløsningen er uenige om beregningen av arbeidsgiverperioden, eller arbeidsgiver har endret en tidligere arbeidsgiverperiode. Undersøk hva som er riktig arbeidsgiverperiode.', 'Arbeidsgiver og vedtaksløsningen har beregnet arbeidsgiverperioden ulikt. Dette kan også gjelde et tidligere sykefraværstilfelle.', e'Vurder hva som er riktig arbeidsgiverperiode. Hvis forslaget til vedtaksløsningen er feil og saken ikke kan korrigeres i Speil, må saken behandles i Infotrygd.
            INSERT INTO api_varseldefinisjon (unik_id, kode, tittel, forklaring, handling, avviklet, opprettet) VALUES ('a06c1800-f98c-4180-8aea-478e76f4f587', 'RV_SØ_15', 'Det er mottatt en korrigert søknad der friskmelding fra søknaden ikke er lagt inn', 'Fra og med 27.3.23 begynte vi å ta inn korrigerende søknader der det er friskmelding (arbeidsdager) i slutten av en søknadsperiode. Dette varselet skal ikke skje på perioder som er opprettet etter 27.3.23. ', 'Dette varselet betyr at arbeidsdagene fra søknaden ikke er lagt inn. Du må legge inn arbeidsdagene fra søknaden manuelt. ', 'false', '2023-04-12 09:30:25.520593') ON CONFLICT(unik_id) DO NOTHING;
            INSERT INTO api_varseldefinisjon (unik_id, kode, tittel, forklaring, handling, avviklet, opprettet) VALUES ('4c03e601-e1b2-4d67-9f19-411131880b7b', 'RV_SØ_15', 'Det er mottatt en korrigert søknad der dagene fra søknaden ikke er lagt inn', 'Fra og med 27.03.23 begynte vi å ta inn korrigerende søknader der det er friskmelding (arbeidsdager) i slutten av en søknadsperiode. Dette varselet skal ikke skje på perioder som er opprettet etter 27.03.23. ', 'Dette varselet betyr at informasjonen fra søknaden ikke er lagt inn. Du må undersøke den korrigerte søknaden og manuelt legge inn korrigeringen i Speil. ', 'false', '2023-04-12 09:41:59.537432') ON CONFLICT(unik_id) DO NOTHING;
            INSERT INTO api_varseldefinisjon (unik_id, kode, tittel, forklaring, handling, avviklet, opprettet) VALUES ('6c55c91c-c6d3-48c3-bbdc-fe2f05c1bb41', 'RV_IV_7', 'Det er gjenbrukt inntektsopplysninger ', 'Dette varselet inntreffer dersom det er mer enn 60 dager siden forrige skjæringstidspunkt og/eller det er ny arbeidsgiverperiode', 'Du må undersøke om inntekten og/eller arbeidsgiverperioden er riktig fastsatt', 'false', '2023-04-13 09:51:43.992131') ON CONFLICT(unik_id) DO NOTHING;
            INSERT INTO api_varseldefinisjon (unik_id, kode, tittel, forklaring, handling, avviklet, opprettet) VALUES ('0a69a4f8-cdf9-49a8-8c02-21aa0e04c091', 'RV_IM_8', 'Arbeidsgiver har redusert utbetaling av arbeidsgiverperioden', 'Systemet har tatt utgangspunkt i arbeidsgiverperiode oppgitt i inntektsmelding, eller første fraværsdag om arbeidsgiver ikke har opplyst om arbeidsgiverperiode, og foreslått utbetaling til den sykemeldte disse dagene.', e'Finne ut når arbeidsgiverperioden skal være og eventuelt overstyre dagene til Syk (NAV) slik beregnes utbetaling til den sykemeldte.
            INSERT INTO api_varseldefinisjon (unik_id, kode, tittel, forklaring, handling, avviklet, opprettet) VALUES ('638058c7-f25e-44de-985f-e5e8293dcebe', 'RV_IM_8', 'Arbeidsgiver har redusert utbetaling av arbeidsgiverperioden', 'Systemet har tatt utgangspunkt i arbeidsgiverperiode oppgitt i inntektsmelding, eller første fraværsdag om arbeidsgiver ikke har opplyst om arbeidsgiverperiode, og foreslått utbetaling til den sykmeldte disse dagene.', e'Finne ut når arbeidsgiverperioden skal være og eventuelt overstyre dagene til Syk (NAV) slik at det beregnes at NAV skal utbetale arbeidsgiverperioden.
            INSERT INTO api_varseldefinisjon (unik_id, kode, tittel, forklaring, handling, avviklet, opprettet) VALUES ('b0d1a50f-a18b-4bde-9791-0b25f2ada3d2', 'RV_IM_8', 'Arbeidsgiver har ikke utbetalt i hele eller deler av arbeidsgiverperioden', 'Det er tatt utgangspunkt i arbeidsgiverperiode oppgitt i inntektsmeldingen, eller første fraværsdag, og foreslått utbetaling til den sykmeldte.', e'Du vurderer om og eventuelt fra hvilket tidspunkt det skal utbetales fra NAV. Du skal eventuelt overstyre dagene til Syk (NAV) slik at det beregnes at NAV skal utbetale arbeidsgiverperioden.
            INSERT INTO api_varseldefinisjon (unik_id, kode, tittel, forklaring, handling, avviklet, opprettet) VALUES ('30454832-dc6b-4baa-88be-980987c22c71', 'RV_UT_22', 'Annullering ble ikke gjennomført', 'Hvorfor finnes ikke denne allerede da?', 'Men den er jo avviklet, så...', 'false', '2023-04-20 10:17:31.308610') ON CONFLICT(unik_id) DO NOTHING;
            INSERT INTO api_varseldefinisjon (unik_id, kode, tittel, forklaring, handling, avviklet, opprettet) VALUES ('a252da3e-3fc8-4325-8ebc-642b8a79393b', 'RV_UT_23', 'Den nye beregningen vil trekke penger i sykefraværstilfellet', 'I én eller flere av vedtaksperiodene som hører til arbeidsgiverperioden er det beregnet et negativt beløp.', 'Se gjennom utbetalingene for alle vedtaksperioder som hører til arbeidsgiverperioden før du utbetaler.', 'false', '2023-04-20 10:18:10.851950') ON CONFLICT(unik_id) DO NOTHING;
            INSERT INTO api_varseldefinisjon (unik_id, kode, tittel, forklaring, handling, avviklet, opprettet) VALUES ('6cd59207-d4d7-4100-b996-43fce3ce540a', 'RV_SØ_3', 'Sykmeldingen er tilbakedatert', 'Sykmeldingen for perioden er tilbakedatert. ', e'Undersøk om det er oppgave «Behandle Elektronisk Sykmelding» med gjelder verdi «Tilbakedatering» eller «Oppdatere fagsystem» i enhetsmappe «Uplassert-Tilbakedatering» i Gosys.
            INSERT INTO api_varseldefinisjon (unik_id, kode, tittel, forklaring, handling, avviklet, opprettet) VALUES ('8a2564ab-05dd-40f8-aec1-b275413f4cb1', 'RV_IM_19', 'Mottatt flere inntektsmeldinger - den siste inntektsmeldingen som ble mottatt er lagt til grunn. Utbetal kun hvis det blir korrekt.', '', '', 'true', '2023-05-04 13:41:28.992025') ON CONFLICT(unik_id) DO NOTHING;
            INSERT INTO api_varseldefinisjon (unik_id, kode, tittel, forklaring, handling, avviklet, opprettet) VALUES ('a636cd94-d8f9-4bb5-982d-35b6bd2ed5d7', 'RV_VV_4', 'Minst én dag uten utbetaling på grunn av arbeidsuførhetsgrad under 20 prosent.', 'Det er beregnet en arbeidsuførhetsgrad på under 20 prosent.', e'Ved ett arbeidsforhold: Dersom du er enig i at det skal være helt eller delvis avslag, kan saken behandles i Speil. Dersom arbeidsgiver forskutterer sykepenger, må avslagsvedtak til arbeidsgiver sendes fra Infotrygd.
            INSERT INTO api_varseldefinisjon (unik_id, kode, tittel, forklaring, handling, avviklet, opprettet) VALUES ('f2d5e911-b707-4269-9b1e-0738041395c1', 'RV_UT_23', 'Det beregnet et negativt beløp.', 'Det er foretatt en beregning av en utbetaling som medfører at det skal utbetales mindre enn det som tidligere er beregnet.  Dette kan for eksempel skje hvis utbetalingen tilbake i tid bytter mottaker eller hvis det er sendt en korrigert søknad eller inntektsmelding. ', 'Se gjennom utbetalingene for alle vedtaksperiodene før du utbetaler. Det kan være i dette eller tidligere sykefraværstilfeller som hører til samme arbeidsgiverperiode. ', 'false', '2023-05-16 12:33:17.357621') ON CONFLICT(unik_id) DO NOTHING;
            INSERT INTO api_varseldefinisjon (unik_id, kode, tittel, forklaring, handling, avviklet, opprettet) VALUES ('8d38c9a9-2b4c-427b-9109-fab99c036263', 'RV_UT_23', 'Det er beregnet et negativt beløp.', 'Det er foretatt en beregning av en utbetaling som medfører at det skal utbetales mindre enn det som tidligere er beregnet.  Dette kan for eksempel skje hvis utbetalingen tilbake i tid bytter mottaker eller hvis det er sendt en korrigert søknad eller inntektsmelding. ', 'Se gjennom utbetalingene for alle vedtaksperiodene før du utbetaler. Det kan være i dette eller tidligere sykefraværstilfeller som hører til samme arbeidsgiverperiode. ', 'false', '2023-05-16 12:34:52.094600') ON CONFLICT(unik_id) DO NOTHING;
            INSERT INTO api_varseldefinisjon (unik_id, kode, tittel, forklaring, handling, avviklet, opprettet) VALUES ('69088a17-7f97-4707-bda0-7ce82646e581', 'RV_SI_3', 'Simuleringen mot oppdragssystemet gir et negativt beløp.', 'Vedtaksløsningen foreslår å omgjøre tidligere utbetaling av sykepenger, slik at hele eller deler av simuleringen gir et negativt beløp.', 'Undersøk om simuleringen gir et ønsket og riktig resultat og korriger hvis simuleringen er feil. Hvis simuleringen er riktig, se rutine for revurdering, feilutbetaling og tilbakekreving.', 'false', '2023-05-16 12:36:08.458571') ON CONFLICT(unik_id) DO NOTHING;
            INSERT INTO api_varseldefinisjon (unik_id, kode, tittel, forklaring, handling, avviklet, opprettet) VALUES ('20c2f34b-1905-4831-8776-e266a682c1bb', 'RV_SI_3', 'Simuleringen mot oppdragsystemet gir et negativt beløp.', 'Vedtaksløsningen foreslår å omgjøre tidligere utbetaling av sykepenger, slik at hele eller deler av simuleringen gir et negativt beløp.', 'Undersøk om simuleringen gir et ønsket og riktig resultat og korriger hvis simuleringen er feil. Hvis simuleringen er riktig, se rutine for revurdering, feilutbetaling og tilbakekreving.', 'false', '2023-05-16 12:36:57.023330') ON CONFLICT(unik_id) DO NOTHING;
