            INSERT INTO api_varseldefinisjon (unik_id, kode, tittel, forklaring, handling, avviklet, opprettet) VALUES ('5c8774ae-b711-4682-ad48-a5621656a350', 'RV_AY_3', 'Det er utbetalt AAP innenfor 6 måneder før skjæringstidspunktet eller overlappende med sykepengeutbetaling.', 'Den sykmeldte har mottatt AAP som kan påvirke retten til sykepenger.  ', e'Kontroller at den sykmeldte har rett til sykepenger. Vær spesielt oppmerksom på opptjening av ny rett til sykepenger etter en eventuell tidligere utbetaling til maksdato. Hvis den sykmeldte ikke har rett til sykepenger, må saken behandles i Infotrygd.
            INSERT INTO api_varseldefinisjon (unik_id, kode, tittel, forklaring, handling, avviklet, opprettet) VALUES ('49b22633-077c-48cb-8cf3-8a0055cdf2bc', 'RV_UT_21', 'Utbetalingen opphører og reberegner tidligere utbetaling.', 'På grunn av endring i for eksempel arbeidsgiverperiode eller andre årsaker, beregner vi én sammenhengende utbetalingssak hvor det tidligere har vært flere.', e'Kontroller at alle utbetalinger blir riktige. Vær spesielt oppmerksom på simuleringene og kontroller eventuelt Oppdragssystemet etter godkjenning i Speil. Det er viktig å behandle hele saken ferdig  og ikke la den ligge halvveis behandlet. Dette fordi det i disse sakene kan bli relativt store negative utbetalinger ved opphøret, som så skal dekkes av relativt store positive utbetalinger ved reberegningen.
            INSERT INTO api_varseldefinisjon (unik_id, kode, tittel, forklaring, handling, avviklet, opprettet) VALUES ('84cb90ac-2e65-4a1b-8714-4db68cb3c7bf', 'RV_UT_21', 'Utbetalingen opphører og reberegner tidligere utbetaling.', 'Det er nå beregnet én sammenhengende utbetalingssak, hvor det tidligere var flere. Dette kan for eksempel skyldes endring i arbeidsgiverperiode(r).', e'Kontroller at alle utbetalinger blir riktige. Vær spesielt oppmerksom på simuleringene og kontroller eventuelt Oppdragssystemet etter godkjenning i Speil. Det er viktig å behandle hele saken ferdig  og ikke la den ligge halvveis behandlet. Dette fordi det i disse sakene kan bli relativt store negative utbetalinger ved opphøret, som så skal dekkes av relativt store positive utbetalinger ved reberegningen.
