            INSERT INTO api_varseldefinisjon (unik_id, kode, tittel, forklaring, handling, avviklet, opprettet) VALUES ('f6bddf59-f785-4ba8-83c3-f0ea4c2f959b', 'RV_RE_1', 'Fant ikke refusjonsgrad for perioden. Undersøk oppgitt refusjon før du utbetaler.', 'Fant ikke informasjon om refusjonsgrad. Dette kan skje dersom arbeidsgiver har satt en annen første fraværsdag enn det som er fastsatt som skjæringstidspunkt.', 'Undersøk hva som er oppgitt i siste inntektsmelding og eventuell informasjon i Infotrygd. Overstyr refusjonen dersom den ikke er fastsatt riktig. ', 'false', '2023-06-13 15:52:45.472303') ON CONFLICT(unik_id) DO NOTHING;
