            INSERT INTO api_varseldefinisjon (unik_id, kode, tittel, forklaring, handling, avviklet, opprettet) VALUES ('2f9988a7-982f-45a8-b5dc-14d8c19f4a00', 'RV_RE_1', 'Fant ikke refusjonsgrad for perioden. Undersøk oppgitt refusjon før du utbetaler.', 'Fant ikke informasjon om refusjonsgrad. Dette kan skje dersom arbeidsgiver har satt en annen første fraværsdag enn det som er fastsatt som skjæringstidspunkt.', 'Undersøk hva som er oppgitt i siste inntektsmelding og eventuell informasjon i Gosys/Infotrygd. Overstyr refusjonen dersom den ikke er fastsatt riktig. ', 'false', '2023-06-14 14:09:54.495822') ON CONFLICT(unik_id) DO NOTHING;
            INSERT INTO api_varseldefinisjon (unik_id, kode, tittel, forklaring, handling, avviklet, opprettet) VALUES ('b83039c7-9eec-4214-baae-37e85a7534c3', 'RV_RE_1', 'Fant ikke refusjonsgrad for perioden. Undersøk oppgitt refusjon før du utbetaler.', 'Fant ikke informasjon om refusjonsgrad. Dette kan skje dersom arbeidsgiver har satt en annen første fraværsdag enn det som er fastsatt som skjæringstidspunkt.', 'Undersøk hva som er oppgitt i siste inntektsmelding og eventuell informasjon i Gosys/Infotrygd. Overstyr refusjonen dersom den ikke er fastsatt riktig, slik at riktig mottaker får sykepengene.', 'false', '2023-06-14 14:11:14.630935') ON CONFLICT(unik_id) DO NOTHING;
