            INSERT INTO api_varseldefinisjon (unik_id, kode, tittel, forklaring, handling, avviklet, opprettet) VALUES ('6c72ae4e-0129-4d34-b7a6-11b62f0121af', 'RV_SØ_2', 'Minst én dag er avslått fordi søknaden er fremsatt for sent.', 'Søknaden har kommet inn etter at fristen for å fremsette krav i paragraf 22-13 tredje ledd er gått ut for hele eller deler av perioden det søkes sykepenger for.', e'Vurder om det er riktig at dagen(e) skal avslås, eller om den sykmeldte fyller vilkårene i unntaksbestemmelsen paragraf 22-13 syvende ledd. Vær spesielt oppmerksom på saker med godkjent tilbakedateringsperiode. Hvis vilkårene i unntaksbestemmelsen er oppfylt eller kravet er rettidig fremsatt etter paragraf 22-13 tredje ledd tidligere, kan du endre dagene fra avslag til syk (med riktig grad) slik at det utbetales sykepenger for dagen(e).
