            INSERT INTO api_varseldefinisjon (unik_id, kode, tittel, forklaring, handling, avviklet, opprettet) VALUES ('1e321ace-3e95-4253-b09c-764c69672d2d', 'RV_IM_4', 'Det er mottatt flere inntektsmeldinger på samme skjæringstidspunkt. Undersøk at utbetalingen blir riktig.', 'Arbeidsgiver har sendt inn flere inntektsmeldinger. ', 'Du må undersøke om det er oppgitt endringer i inntekt, refusjon eller arbeidsgiverperiode som skal legges til grunn i saken. Speil tar selv inn endringer i inntekt og refusjon, mens saksbehandler selv må registrere eventuelle endringer av arbeidsgiverperioden etter at perioden er sendt til godkjenning. Se  <p><a href="video med demonstrasjon av strekking av tidslinjer">https://navno.sharepoint.com/:v:/r/sites/SykepengerInnfringnyttsaksbehandlingssystem-ViktiginformasjontilsaksbehandlereiSpeil/Delte%20dokumenter/Viktig%20informasjon%20-%20Speil/Hvordan%20legge%20til%20dager%20for%20%C3%A5%20flytte%20AGP.webm?csf=1&web=1&e=rgUsWE</a></p>.', 'false', '2023-06-29 14:13:43.094369') ON CONFLICT(unik_id) DO NOTHING;
