            INSERT INTO api_varseldefinisjon (unik_id, kode, tittel, forklaring, handling, avviklet, opprettet) VALUES ('dec9a935-b8ca-4d12-888b-2cfa35eaa78d', 'RV_IM_4', 'Det er mottatt flere inntektsmeldinger på samme skjæringstidspunkt. Undersøk at utbetalingen blir riktig.', 'Arbeidsgiver har sendt inn flere inntektsmeldinger. ', 'Du må undersøke om det er oppgitt endringer i inntekt, refusjon eller arbeidsgiverperiode som skal legges til grunn i saken. Speil tar selv inn endringer i inntekt og refusjon, mens saksbehandler selv må registrere eventuelle endringer av arbeidsgiverperioden etter at perioden tidligere er sendt til godkjenning.', 'false', '2023-06-29 14:24:09.115586') ON CONFLICT(unik_id) DO NOTHING;
            INSERT INTO api_varseldefinisjon (unik_id, kode, tittel, forklaring, handling, avviklet, opprettet) VALUES ('9be2cc91-6b7b-41d4-9af5-ac86991a39a3', 'RV_IT_37', 'Det er en utbetaling i Infotrygd nærmere enn 20 dager', 'Det er foretatt en utbetaling fra Infotrygd som ligger mindre enn 20 dager fra perioden du nå skal revurdere i Speil.', 'Kontroller at revurderingen/utbetalingen blir riktig. Vær særlig oppmerksom på arbeidsgiverperioden, da denne allerede kan være gjennomført i forbindelse med Infotrygd-utbetalingen.', 'false', '2023-07-03 12:28:34.041463') ON CONFLICT(unik_id) DO NOTHING;
            INSERT INTO api_varseldefinisjon (unik_id, kode, tittel, forklaring, handling, avviklet, opprettet) VALUES ('37b012ae-7c40-460f-862b-e4b80afbb1e9', 'RV_IM_4', 'Det er mottatt flere inntektsmeldinger på samme skjæringstidspunkt. Undersøk at utbetalingen blir riktig.', 'Arbeidsgiver har sendt inn flere inntektsmeldinger. ', 'Du må undersøke om det er oppgitt endringer i inntekt, refusjon eller arbeidsgiverperiode som skal legges til grunn i saken. Hvis det er endringer som skal legges til grunn som Speil ikke selv har registrert, må du endre/revurdere manuelt.', 'false', '2023-07-07 10:13:13.093146') ON CONFLICT(unik_id) DO NOTHING;
